(1, 'Terms & Conditions', '<p>Terms &amp; Conditions</p><p>Welcome to M K Services. By accessing or using our website, mobile application, and services, you agree to comply with the following Terms &amp; Conditions. Please read them carefully before booking any service.</p><p>1. General</p><p>M K Services is a service platform that connects customers with verified technicians for household, appliance, and maintenance services.</p><p>By booking a service, the customer agrees to follow these terms.</p><p>M K Services reserves the right to update or modify these terms at any time without prior notice.</p><p>2. Service Booking</p><p>Customers can book services through the M K Services website or mobile application.</p><p>Bookings are confirmed only when the request is accepted by a technician.</p><p>M K Services reserves the right to cancel or reschedule a service if necessary (e.g., unavailability of technicians, safety issues, or unforeseen circumstances).</p><p>3. Payments</p><p>Customers can pay using online methods (UPI, debit/credit cards, wallets) or choose cash payment at the time of service.</p><p>Prices are transparent and displayed before booking. No hidden charges will be applied.</p><p>Service charges may vary depending on the type of issue and spare parts required (if any).</p><p>4. Cancellation &amp; Refunds</p><p>If the customer cancels the booking before the technician accepts, a full refund will be processed.</p><p>Once a technician has accepted the booking, no refund will be issued under any circumstances.</p><p>Customers can cancel their booking directly through the app or website using the cancellation option.</p><p>Refunds (if applicable) will be processed within 7-10 business days to the original payment method.</p><p>5. Customer Responsibilities</p><p>Customers must provide accurate details (address, contact number, problem description) when booking a service.</p><p>Customers must ensure a safe working environment for the technician.</p><p>Any misuse of the platform, fraudulent bookings, or misbehavior with technicians will result in account suspension.</p><p>6. Technician Verification &amp; Responsibilities</p><p>All M K Services technicians undergo background verification before being allowed to provide services.</p><p>Technicians are required to maintain professional behavior, honesty, and respect toward customers.</p><p>Technicians must not demand extra charges beyond what is shown on the application unless additional parts or services are required (with customer approval).</p><p>Any misconduct or fraudulent activity by technicians will lead to permanent removal from M K Services\'s network.</p><p>7. Safety &amp; Security</p><p>M K Services takes customer safety seriously. Verified ID and background checks are mandatory for all technicians.</p><p>Customers are advised not to make direct payments outside of the official AuraClap platform.</p><p>M K Services will not be responsible for any damages caused by unauthorized dealings outside the platform.</p><p>8. Warranty &amp; Service Guarantee</p><p>M K Services provides a limited service warranty (if applicable) on certain services, which will be clearly mentioned during booking.</p><p>Warranty does not cover damages caused by misuse, negligence, or third-party intervention after the service is completed.</p><p>9. Limitation of Liability</p><p>M K Services acts only as a platform connecting customers with technicians.</p><p>M K Services is not responsible for any direct, indirect, incidental, or consequential damages that may occur during or after the service.</p><p>Customers are encouraged to immediately report any issue with technicians so that appropriate action can be taken.</p><p>10. User Account</p><p>Customers and technicians must register with accurate personal details.</p><p>Users are responsible for maintaining the confidentiality of their login credentials.</p><p>M K Services reserves the right to suspend or terminate accounts in case of fraud, misuse, or violation of these terms.</p><p>11. Dispute Resolution</p><p>Any disputes or complaints regarding services must be reported to M K Services customer support within 48 hours of service completion.</p><p>M K Services will investigate and take appropriate steps to resolve the matter.</p><p>In case of legal disputes, the jurisdiction will lie within the courts of [Insert City/State, e.g., Delhi, India].</p><p>12. Contact Us</p><p>For any questions, complaints, or clarifications regarding these Terms &amp; Conditions, you can reach us at:<br> Email: [support@auraclap.com]<br> Customer Care: [9875134775]</p><p> By using AuraClaps services, you acknowledge that you have read, understood, and agreed to these Terms &amp; Conditions.</p>', 'Terms-Conditions', 1, 0, NULL, '2025-09-09 05:02:22', '103.1.100.226'),
(2, 'Customer and Technician', '<p> For Our Customers</p><p>At M K Services, your comfort and peace of mind come first. We understand how stressful it can be when appliances break down or maintenance issues disrupt your daily life. Thats why we are committed to delivering reliable, safe, and affordable services right at your doorstep.</p><p> Wide Range of Services</p><p>From AC repair to washing machine maintenance, from hostel room fixes to household issues  M K Services covers it all. No matter the problem, we provide expert solutions quickly and efficiently.</p><p> Verified &amp; Trusted Technicians</p><p>Your safety is our top priority. Every M K Services technician goes through a strict background verification process before joining our network. Only trusted, skilled, and responsible professionals are sent to your home.</p><p> Customer Safety &amp; Care</p><p>We take extra measures to ensure your safety:</p><p>Verified IDs of every technician</p><p>Real-time tracking of service status</p><p>Secure online payment options</p><p>Transparent communication from start to finish</p><p> Affordable &amp; Transparent Pricing</p><p>With M K Services, you never have to worry about hidden charges. We provide upfront, affordable pricing so you always know what you are paying for. Our aim is to deliver high-quality service at the best price.</p><p> Why Customers Love M K Services</p><p>24/7 support for urgent repairs</p><p>Quick response time</p><p>Professional and polite technicians</p><p>Hassle-free booking and cancellation options</p><p>M K Services is designed to make your life easier, safer, and more comfortable.</p><p> For Our Technicians</p><p>At M K Services, we dont just care about customers  we also care deeply about our technicians, because they are the backbone of our service.</p><p> Work That Fits Your Daily Life</p><p>We connect technicians with genuine and verified service requests every day, helping them earn a steady income while enjoying flexible working hours.</p><p> Trustworthy &amp; Secure Opportunities</p><p>Only qualified and trustworthy technicians are onboarded into AuraClap. This ensures a professional community where you can work with confidence and pride.</p><p> We Care About You &amp; Your Family</p><p>M K Services believes in providing technicians with the best customers and safe work environments, so they can support their families without worry. Our platform ensures that technicians get respect, timely payments, and rewarding work experiences.</p><p> Benefits for Technicians</p><p>Steady flow of service requests</p><p>Easy-to-use app for job updates</p><p>Fair and timely payments</p><p>Customer ratings that build trust and reputation</p><p>Work-life balance with flexible schedules</p><p> Our Commitment</p><p>We make sure that every technician working with M K Services feels valued, respected, and motivated. Because when our technicians are happy, our customers are happy too.</p><p> Together, M K Services creates a win-win experience  Customers enjoy trusted, affordable services, while Technicians enjoy respect, security, and rewarding opportunities.</p>', 'Customer-Technicial', 1, 0, NULL, '2025-09-09 05:07:10', '103.1.100.226'),
(3, 'Cancellation and Refund', '<p>MK SERVICES believes in helping its customers as far as possible, and has therefore a liberal cancellation policy. Under this policy: Cancellations will be considered only if the request is made within 1-2 days of placing the order. However, the cancellation request may not be entertained if the orders have been communicated to the vendors/merchants and they have initiated the process of shipping them. MK SERVICES does not accept cancellation requests for perishable items like flowers, eatables etc. However, refund/replacement can be made if the customer establishes that the quality of product delivered is not good. In case of receipt of damaged or defective items please report the same to our Customer Service team. The request will, however, be entertained once the merchant has checked and determined the same at his own end. This should be reported within 1-2 days of receipt of the products. In case you feel that the product received is not as shown on the site or as per your expectations, you must bring it to the notice of our customer service within 1-2 days of receiving the product. The Customer Service Team after looking into your complaint will take an appropriate decision. In case of complaints regarding products that come with a warranty from manufacturers, please refer the issue to them. In case of any Refunds approved by the MK SERVICES, itll take 6-8 days for the refund to be processed to the end customer.</p>', 'Refund-Policy', 1, 0, NULL, '2025-09-02 08:54:58', '103.1.100.226'),
(4, 'Privacy Policy', '<p>Privacy Policy</p><p>At M K Services, we value your trust and are committed to protecting your privacy. This Privacy Policy explains how we collect, use, share, and safeguard your personal information when you use our website, mobile application, and services.</p><p>By using M K Services, you agree to the practices described in this Privacy Policy.</p><p>1. Information We Collect</p><p>We may collect the following types of information from customers and technicians:</p><p>a) Personal Information</p><p>Name, phone number, email address, home/office address</p><p>Payment details (UPI, credit/debit card, wallet details  processed via secure third-party gateways)</p><p>Identity details (only for technicians during background verification)</p><p>b) Non-Personal Information</p><p>Device information (browser type, IP address, operating system)</p><p>Location data (to provide location-based services)</p><p>Service usage data (pages visited, time spent, bookings made)</p><p>2. How We Use Your Information</p><p>We use collected information to:</p><p>Provide and improve our services</p><p>Process bookings and payments</p><p>Match customers with suitable, verified technicians</p><p>Ensure safety and background verification of technicians</p><p>Send notifications about bookings, offers, and updates</p><p>Improve customer support and resolve disputes</p><p>Comply with legal and regulatory requirements</p><p>3. Sharing of Information</p><p>M K Services respects your privacy and does not sell or rent your personal information. However, we may share your information in the following cases:</p><p>With Technicians: Customer contact details and service address are shared with assigned technicians only to complete the requested service.</p><p>With Customers: Technician name, photo, and contact details are shared with the customer for transparency and safety.</p><p>With Service Providers: Payment gateways, analytics providers, and communication services may access limited data to perform their roles.</p><p>For Legal Reasons: If required by law, regulation, or government request, we may disclose information to protect AuraClap, our users, or the public.</p><p>4. Data Security</p><p>All personal information is stored securely and protected against unauthorized access.</p><p>Payments are processed using secure and encrypted gateways. M K Services does not store sensitive financial data like card numbers.</p><p>Regular audits and security checks are performed to safeguard your data.</p><p>5. Cookies &amp; Tracking</p><p>Our website/app may use cookies and tracking technologies to:</p><p>Improve user experience</p><p>Analyze traffic and usage patterns</p><p>Save preferences for faster access</p><p>Users can disable cookies in their browser settings, but some features of the service may not work properly.</p><p>6. User Rights</p><p>As an M K Services customer or technician, you have the right to:</p><p>Access and review your personal information stored with us</p><p>Request corrections to inaccurate or incomplete data</p><p>Request deletion of your account and associated data (subject to legal obligations)</p><p>Opt-out of promotional communications at any time</p><p>7. Childrens Privacy</p><p>M K Services services are not intended for children under the age of 13. We do not knowingly collect information from minors. If we become aware that a child has provided personal information, we will delete it immediately.</p><p>8. Third-Party Links</p><p>M K Services\'s platform may contain links to third-party websites or services. We are not responsible for the privacy practices of these third parties. Users are encouraged to read their privacy policies.</p><p>9. Changes to Privacy Policy</p><p>AuraClap may update this Privacy Policy from time to time. Any changes will be posted on our website/app, and continued use of services after changes implies acceptance of the updated policy.</p><p><br> At M K Services, your trust is our priority. We are committed to ensuring that your data is handled with transparency, security, and care.</p>', 'Privacy-Policy', 1, 0, NULL, '2025-09-09 05:09:33', '103.1.100.226');
