(1, 1, 'Which type of washing machine is more energy-efficient?', 'Top-load washer', 'Front-load washer', 'Semi-automatic washer', 'Manual washer', 'B', 1, 0, '2025-02-07 11:24:42', '2025-02-07 11:24:42', NULL),
