(3, 1, 'Which of the following detergent types is best suited for high-efficiency (HE) washing machines?', 'Regular powder detergent', 'HE liquid detergent', 'Dish soap', 'Bar soap', 'B', 1, 0, '2025-02-07 11:42:34', '2025-02-07 11:42:34', '127.0.0.1'),
(4, 1, 'What does the \"spin cycle\" in a washing machine do?', 'Mixes detergent and water', 'Removes excess water from clothes', 'Heats the water', 'Adds extra fabric softener', 'B', 1, 0, '2025-02-07 11:44:46', '2025-02-07 11:44:46', '127.0.0.1'),
(5, 1, 'What is the ideal load capacity for a family of four?', '3-5 kg', '6-8 kg', '9-12 kg', '12-15 kg', 'B', 1, 0, '2025-02-07 11:46:06', '2025-02-07 11:46:06', '127.0.0.1'),
