INSERT INTO `faq-masters` (`id`, `question`, `answer`, `category`, `isActive`, `createdAt`, `updatedAt`, `created_at`, `updated_at`, `strIP`) VALUES
(1, 'How does Auraclap service work?', 'Customers book service through the app, a technician visits their home, fixes the issue, and payment is made after service completion.', NULL, 1, NULL, NULL, '2025-08-25 05:47:57', '2025-08-25 05:47:57', '103.1.100.226'),
(2, 'Which appliances does Auraclap repair?', 'Auraclap provides doorstep repair and maintenance for ACs, refrigerators, washing machines, TVs, microwaves, and other common household appliances.', NULL, 1, NULL, NULL, '2025-08-25 05:48:56', '2025-08-25 05:48:56', '103.1.100.226'),
(3, 'Are Auraclap technicians verified?', 'Yes, all technicians are background-verified, trained, and provide customers with secure, professional, and trustworthy repair service at their doorstep.', NULL, 1, NULL, NULL, '2025-08-25 05:49:14', '2025-08-25 05:49:14', '103.1.100.226'),
(4, 'How are service charges decided?', 'Charges depend on appliance type, issue, and repair nature, but Auraclap always ensures transparent pricing and affordable service.', NULL, 1, NULL, NULL, '2025-08-25 05:49:40', '2025-08-25 05:49:40', '103.1.100.226'),
(5, 'How can customers make payment?', 'Customers can pay securely after service completion using cash, UPI, debit/credit card, or directly through the Auraclap app.', NULL, 1, NULL, NULL, '2025-08-25 05:50:00', '2025-08-25 05:50:00', '103.1.100.226');
