INSERT INTO `Rate` (`rate_id`, `cate_id`, `subcate_id`, `city_id`, `title`, `description`, `how_it_work_description`, `amount`, `iStatus`, `isDelete`, `created_at`, `updated_at`, `strIP`, `time`) VALUES
(2, 9, 3, 2, 'AC Not Cooling', 'If your AC is not cooling, it may be due to low refrigerant, dirty filters, or compressor faults. Our experts diagnose and repair to restore effective and fast cooling.', '<p><strong>Below Cases you must should book a/c not cooling service:</strong><br>&nbsp;1.If your a/c is not throwing cool air accouraging to temperature.<br>&nbsp;2.In any case if you figure out that your a/c fan is damaged then book a service.<br>3.Basic if your a/c dose not cool then.<br>4.In case your a/c Blowing Out hot air then also.<br>5.If your a/c is in big area room then also it cases low cool problem.<br>6.Sometimes your a/c needs to get service aft long use ago then also it blow low cool air.<br>7.In any case of your a/c is broken from outside.<br>8.If your a/c faces Low Refrigerant (Gas Leak) Issue.<br>9.If feel like your a/c is Blocked or Dirty Condenser Unit (Outdoor Unit).<br>10.Any type of problem you feel like related to a/c cooling and you can not understand the issue just book&nbsp;the&nbsp;service.</p>', 599, 1, 0, '2025-06-02 07:28:47', '2025-08-20 12:09:57', '223.236.127.103', NULL),
(3, 9, 5, 1, 'On/off Issue', 'AC not turning on or off may result from faulty wiring, PCB issues, or switch defects. Our service ensures safe inspection and repair for smooth and reliable operation.', '<p><strong>Below Cases you must should book a/c on/off service:</strong><br>1.Is your A/C turning on and off every few minutes without completing a full cooling cycle?<br>2.Have you noticed your A/C turning off shortly after starting, especially in cooler weather?<br>3.Is your A/C frequently shutting off and restarting, even when the room hasn\'t reached the desired temperature?<br>4.Do you observe your A/C turning off after running for a short time, accompanied by unusual noises or smells?<br>5.Is your A/C turning off and on frequently, and you\'ve already checked the thermostat settings?<br>6.Is your A/C turning off after a short period of operation, and you\'ve recently replaced the air filter?<br>7.Does your A/C turn off unexpectedly, and you\'ve already ensured proper airflow and ventilation?<br>8.Is your A/C turning off and on frequently, and you\'ve recently had maintenance or repairs done?<br>9.Is your A/C turning off after a short time, and you\'ve checked for refrigerant leaks?<br>10.Are you experiencing frequent A/C shutdowns, and you\'re unsure of the cause?</p><p><br>&nbsp;</p>', 499, 1, 0, '2025-06-02 08:40:24', '2025-08-20 12:10:15', '223.236.127.103', NULL),
(5, 9, 6, 1, 'Wire Issue', 'Faulty or burnt wiring can stop the AC from working and cause safety hazards. Our experts replace damaged wires and secure connections for safe and efficient functioning.', '<p><strong>Below Cases you must should book a/c Wire service:</strong><br>1.Is your A/C not turning on at all?<br>2.Are you experiencing frequent tripping of circuit breakers when the A/C operates?<br>3.Do you notice visible damage to the power cord or plug?<br>4.Is there a burning smell emanating from the A/C unit?<br>5.Is the A/C unit not responding to remote control commands?<br>6.Are there sparks or unusual noises when the A/C is operating?<br>7.Is the A/C unit displaying error codes related to electrical components?<br>8.Is the A/C unit\'s display panel flickering or showing inconsistent readings?<br>9.Is the A/C unit turning on and off unexpectedly?<br>10.Are you unsure about the cause of electrical irregularities in your A/C?</p>', 499, 1, 0, '2025-06-03 11:57:40', '2025-08-20 12:10:31', '223.236.127.103', NULL),
(6, 9, 7, 1, 'Water leak', 'Water leakage from AC units usually occurs due to clogged drain pipes or damaged coils. Our service ensures proper cleaning and sealing to prevent leaks and maintain smooth operation.', '<p><strong>Below Cases you must should book a/c Water leak service:</strong><br>1.Is water dripping from the indoor unit of your A/C?<br>2.Do you notice water pooling around the base of the A/C unit?<br>3.Is there water leakage during or after heavy rainfall?<br>4.Is the A/C unit producing excess moisture or condensation?<br>5.Are there signs of mold or mildew near the A/C unit?<br>6.Is the A/C unit emitting a musty or damp odor?<br>7.Is the water leakage affecting the surrounding walls or flooring?<br>8.Is the A/C unit leaking water even when not in operation?<br>9.Is the water leakage affecting the unit\'s cooling performance?<br>10.Are you unsure about the cause of water leakage in your A/C?</p>', 499, 1, 0, '2025-06-03 12:01:59', '2025-08-20 12:10:46', '223.236.127.103', NULL),
(7, 9, 8, 1, 'Air Problem', 'If your AC is not blowing air properly, it may be due to blower motor issues, clogged filters, or fan faults. Our service restores smooth and consistent airflow.', '<p><strong>Below Cases you must should book a/c Blowing air problem service:</strong><br>1.Is your A/C blowing warm or hot air instead of cool air?<br>2.Is the airflow from the A/C unit weak or inconsistent?<br>3.Is the A/C unit producing unusual noises when operating?<br>4.Is the A/C unit blowing air unevenly across the room?<br>5.Is the A/C unit failing to reach the desired temperature?<br>6.Is the A/C unit emitting a foul or musty odor?<br>7.Is the A/C unit\'s airflow direction not adjustable?<br>8.Is the A/C unit\'s fan running but no cool air is being produced?<br>9.Is the A/C unit\'s airflow temperature inconsistent across different areas?<br>10.Are you unsure about the cause of airflow problems in your A/C?</p><p>&nbsp;</p><p><br>&nbsp;</p>', 499, 1, 0, '2025-06-03 12:04:13', '2025-08-20 12:11:07', '223.236.127.103', NULL),
(8, 9, 9, 1, 'Outdoor Unit Issue', 'Outdoor unit problems may involve condenser coil damage, fan issues, or compressor failure. Our experts inspect and repair to ensure reliable cooling performance.', '<p><strong>Below Cases you must should book a/c Outdoor unit Issue service:</strong><br>1.Is the outdoor unit of your A/C making unusual noises?<br>2.Is the outdoor unit vibrating excessively during operation?<br>3.Is the outdoor unit emitting smoke or unusual odors?<br>4.Is the outdoor unit\'s fan not spinning or operating intermittently?<br>5.Is the outdoor unit\'s condenser coil dirty or obstructed?<br>6.Is the outdoor unit\'s drainage system clogged or leaking?<br>7.Is the outdoor unit\'s electrical wiring exposed or damaged?<br>8.Is the outdoor unit\'s area surrounded by vegetation or debris?<br>9.Is the outdoor unit\'s unit base uneven or improperly installed?<br>10.Are you unsure about the condition of your outdoor A/C unit?<br>&nbsp;</p>', 499, 1, 0, '2025-06-03 12:06:11', '2025-08-20 12:11:23', '223.236.127.103', NULL),
(9, 11, 10, 1, 'AC Bad Smell', 'RAISE A SERVICE BOOKING !!', '<p><strong>Below Cases you must should book Refrigerator smell problem service:</strong><br>1.Basically, if there\'s a strong chemical, plastic, or burnt odor.</p><p>2.In case your refrigerator smells from the back side or compressor area.</p><p>3.If you store food in sealed containers and still the fridge smells.</p><p>4.Sometimes, a clogged drain pipe or blocked vent can cause bad smells.</p><p>5.If mold, fungus, or green/black spots are visible inside the fridge.</p><p>6.In any case of dead animal smell or gas-type smell from behind the fridge.</p><p>7.If your fridge smells bad even with an odor remover inside.</p><p>8.Any type of smell problem you cannot identify  book the service.<br>9.If you notice a bad or unusual smell coming from inside the fridge even after cleaning.</p><p>10.In any case, if the smell returns shortly after removing spoiled food.</p>', 499, 1, 0, '2025-06-03 12:08:28', '2025-08-12 16:14:39', '49.14.164.163', NULL),
(11, 9, 11, 1, 'Sensor Problem', 'Sensor faults can lead to wrong temperature readings or irregular cooling. Our experts repair or replace faulty sensors to ensure accurate performance and comfort.', '<p><strong>Below Cases you must should book a/c Sensor service:</strong></p><p>1.Is your A/C running constantly without reaching the set temperature?<br>2.Are you noticing inconsistent temperature readings on the thermostat?<br>3.Is the A/C unit turning on and off frequently without completing a cooling cycle?<br>4.Is the A/C unit displaying error codes related to sensors?<br>5.Is the A/C unit\'s remote control not responding or showing incorrect readings?<br>6.Is the A/C unit\'s display panel flickering or showing inconsistent information?<br>7.Is the A/C unit\'s cooling performance inconsistent across different areas?<br>8.Is the A/C unit emitting unusual sounds during operation?<br>9.Is the A/C unit\'s airflow direction or speed not adjustable?<br>10.Are you unsure about the cause of temperature inconsistencies in your A/C?</p><p><br>&nbsp;</p>', 499, 1, 0, '2025-06-03 12:10:17', '2025-08-20 12:11:52', '223.236.127.103', NULL),
(12, 9, 12, 1, 'Any Other Issue?', 'We handle all other AC issues including unusual noise, tripping, or power faults. Our complete inspection and expert repair ensure smooth, safe, and long-lasting cooling.', '<p>So, After all this services, <strong>ARE YOU STILL CONFUSE??, </strong>then just book this other Issue section.</p>', 299, 1, 0, '2025-06-03 12:12:04', '2025-08-20 12:12:17', '223.236.127.103', NULL),
(13, 11, 13, 1, NULL, 'RAISE A SERVICE BOOKING !!', '<p><strong>Below Cases you must should book Refrigerator cooling Issue service:</strong><br>1.If your fridge is not keeping food cold, even after setting the correct temperature.</p><p>2.In any case, if ice is not forming in the freezer or ice is melting.</p><p>3.Basically, if you feel your milk or vegetables spoil faster than usual.</p><p>4.In case your refrigerator feels warm inside even though the compressor is running.</p><p>5.If your fridge is overloaded or placed in a very hot area, it may cause low cooling.</p><p>6.Sometimes, after long use without servicing, cooling efficiency drops  then also book a service.</p><p>7.In any case, if cooling is uneven (some shelves cold, others not).</p><p>8.If you hear the motor running constantly but no cooling inside.</p><p>9.If frost buildup blocks airflow and affects cooling.</p><p>10.Any type of cooling issue you dont understand  just book a service.</p>', 499, 1, 0, '2025-06-03 12:13:23', '2025-06-13 18:04:04', '27.97.222.82', NULL),
(14, 9, 14, 1, 'Gas changing', 'Low refrigerant gas reduces cooling efficiency and strains the AC compressor. Our service includes leak detection, proper refilling, and pressure testing to ensure powerful, long-lasting, and energy-efficient cooling performance.', '<p><strong>Below Cases you must should book a/c Gas service:</strong><br>1.Is your A/C not cooling effectively, even when set to the lowest temperature?</p><p>2.Do you notice ice forming on the evaporator coils or refrigerant lines?<br>3.Is the A/C blowing warm air instead of cool air?<br>4.Is the A/C running longer than usual without reaching the desired temperature?<br>5.Are there hissing or bubbling sounds coming from the A/C unit?<br>6.Is there a noticeable increase in energy bills despite consistent usage patterns?<br>7.Have you observed a decrease in airflow from the A/C vents?<br>8.Is the A/C unit cycling on and off more frequently than usual?<br>9.Is there a noticeable increase in humidity levels indoors?<br>10.Are you unsure about the cause of cooling inefficiency in your A/C?</p><p><br>&nbsp;</p>', 399, 1, 0, '2025-06-03 12:14:12', '2025-08-20 12:13:05', '223.236.127.103', NULL),
(15, 11, 16, 1, 'In cases of earthing', 'RAISE A SERVICE BOOKING !!', '<p><strong>Below Cases you must should book Refrigerator wire earthing service:</strong><br>1.If you feel a mild electric shock when touching the fridge.</p><p>2.In any case, if the fridge plug or wire gets hot or smells burnt.</p><p>3.Basically, if the fridge trips your home circuit breaker frequently.</p><p>4.In case the fridge sparks or shows exposed wires near the plug.</p><p>5.If the power socket shows black marks or burning signs.</p><p>6.Sometimes, poor earthing or loose wiring can cause electric leakage  then also book a service.</p><p>7.If your fridge turns off and on randomly or flickers.</p><p>8.If any metal part of the fridge feels charged or gives a tingling sensation.</p><p>9.If there is a buzzing or humming noise from the plug or wiring area.</p><p>10.Any type of electric or earthing problem you are unsure of  book the service immediately.</p>', 399, 1, 0, '2025-06-03 12:15:11', '2025-06-13 18:08:34', '27.97.222.82', NULL),
(16, 11, 17, 1, 'Water IssueS', 'RAISE A SERVICE BOOKING !!', '<p><strong>Below Cases you must should book Refrigerator water leakage service:</strong><br>1.If you find water under or around your fridge regularly.</p><p>2.In any case, if theres water inside the fridge or around the vegetable box.</p><p>3.Basically, if your fridge forms ice and then it melts and leaks.</p><p>4.In case the freezer is overfrozen and starts dripping water.</p><p>5.If the drain hole is blocked and water collects inside the unit.</p><p>6.Sometimes, gas pressure issues or poor cooling lead to water leak.</p><p>7.If your fridge is tilted and causing water to spill out.</p><p>8.If the water collection tray at the back is overflowing or broken.</p><p>9.If your double-door fridge leaks from the door seal or hinges.</p><p>10.Any type of unknown water leak  just book a service.</p>', 499, 1, 0, '2025-06-03 12:16:00', '2025-06-13 18:10:43', '27.97.222.82', NULL),
(17, 9, 18, 1, 'Dirt Smell problems', 'Dirty air from your AC may be caused by clogged filters, dust buildup, or unclean ducts. Our service includes thorough cleaning, filter replacement, and sanitization to ensure fresh, healthy, and dust-free cooling.', '<p><strong>Below Cases you must should book a/c Dirty Air Issue service:</strong><br>1.Is the A/C emitting unpleasant or musty odors?<br>2.Are you experiencing increased allergy symptoms indoors?<br>3.Is the A/C blowing dust or debris into the room?<br>4.Is there visible mold or mildew around the A/C vents or unit?<br>5.Is the A/C producing excessive noise during operation?<br>6.Is there a noticeable increase in respiratory issues when the A/C is running?<br>7.Is the A/C failing to cool the room evenly?<br>8.Is there visible dirt or debris around the A/C unit or vents?<br>9.Is the A/C unit running longer than usual to achieve the desired temperature?<br>10.Are you unsure about the cleanliness or condition of your A/C system?<br>&nbsp;</p>', 399, 1, 0, '2025-06-03 12:17:33', '2025-08-20 12:13:47', '223.236.127.103', NULL),
(19, 10, 19, 1, 'Smoke Problem', 'Smoke from an appliance may indicate electrical faults, overheating, or burnt components. Our service provides urgent inspection, safe repairs, and part replacement to prevent hazards and restore reliable, worry-free performance.', '<p><strong>Below Cases you must should book Microwave Overheating service:</strong><br>1.Is your microwave becoming unusually hot to the touch during or after use?<br>2.Does your microwave shut off abruptly during operation, especially after extended use?<br>3.Is your microwave taking longer than usual to heat food or not heating evenly?<br>4.Are you noticing a burning smell or smoke emanating from the microwave?<br>5.Is your microwave emitting unusual noises, such as buzzing or humming, during operation?<br>6.Is the exterior of your microwave warm even when not in use?<br>7.Does your microwave trip the circuit breaker or blow fuses when in use?<br>8.Is the microwave\'s turntable not rotating or moving erratically?<br>9.Is there a noticeable decrease in the microwave\'s performance over time?<br>10.Are you unsure about the cause of your microwave\'s overheating issues?</p><p><br>&nbsp;</p>', 299, 1, 0, '2025-06-11 08:48:56', '2025-08-20 12:21:12', '223.236.127.103', NULL),
(20, 9, 23, 1, 'Noise solution', 'Unusual noise from your AC may come from loose parts, faulty fan motor, or compressor issues. Our experts inspect, repair, and lubricate components to restore smooth, quiet, and efficient cooling performance.', '<p><strong>Below Cases you must should book a/c noise making service:</strong><br>1.Is your A/C making a loud banging or clanking noise?<br>2.Do you hear a persistent buzzing sound coming from the unit?<br>3.Is your A/C emitting a high-pitched squealing or screeching noise?<br>4.Are you noticing a rattling sound during operation?<br>5.Does your A/C produce a hissing or whistling noise?<br>6.Is there a grinding noise coming from the unit?<br>7.Are you hearing clicking sounds when the A/C starts or stops?<br>8.Is your A/C emitting a whooshing or whirring noise?<br>9.Do you hear gurgling or bubbling noises from the unit?</p><p>10.Are you unsure about the source of the noise or its cause?<br>&nbsp;</p>', 399, 1, 0, '2025-06-13 14:28:50', '2025-08-20 12:16:26', '223.236.127.103', NULL),
(21, 10, 20, 1, 'Light  On/off', 'If the microwave light isnt working, it may be due to bulb, wiring, or control faults. Our experts replace or repair to restore proper visibility and safe operation.', '<p><strong>Below Cases you must should book Microwave light on/off Issue service:</strong><br>&nbsp;</p><p>1.Is the microwave light flickering or not turning on at all?<br>2.Does the microwave light stay on even when the door is closed and the unit is not in use?<br>3.Is the microwave light turning on when the door is open?<br>4.Is the microwave light not turning off after cooking is complete?<br>5.Is the microwave light turning on and off intermittently during operation?<br>6.Is the microwave light dimmer than usual?<br>7.Is the microwave light turning on without any apparent reason?<br>8.Is the microwave light turning off during cooking?<br>9.Is the microwave light turning on and staying on even after pressing the stop button?<br>10.Is the microwave light not responding to the door being opened or closed?</p>', 299, 1, 0, '2025-06-13 15:15:23', '2025-08-20 12:21:52', '223.236.127.103', NULL),
(22, 10, 21, 1, 'Sensor Issue', 'Defective sensors may cause wrong temperature detection or improper cooking. Our service diagnoses and fixes sensor issues to ensure accurate performance and safe cooking results.', '<p><strong>Below Cases you must should book Microwave Sensor Issue service:</strong><br>1.Is the microwave not detecting humidity levels correctly during sensor cooking?<br>2.Is the microwave not adjusting cooking time based on food moisture content?<br>3.Is the microwave not turning off automatically when sensor cooking is complete?<br>4.Is the microwave displaying error messages related to sensor cooking?<br>5.Is the microwave not recognizing certain foods during sensor cooking?<br>6.Is the microwave taking longer than usual to cook food during sensor cooking?<br>7.Is the microwave not adjusting power levels during sensor cooking?<br>8.Is the microwave not starting sensor cooking programs?<br>9.Is the microwave not responding to sensor cooking settings?<br>10.Is the microwave not displaying sensor cooking options?</p><p>&nbsp;</p>', 399, 1, 0, '2025-06-13 15:22:54', '2025-08-20 12:22:39', '223.236.127.103', NULL),
(23, 10, 22, 1, 'Fire Issue', 'Microwave fire issues can be caused by damaged wires, short circuits, or faulty parts. Our service provides safe inspection, repair, and replacement to prevent hazards and ensure safe cooking.', '<p><strong>Below Cases you must should book Microwave fire Issue service:</strong><br>1.Why did my microwave catch fire while heating food?<br>2.Are there certain foods or materials that can cause a microwave to catch fire?<br>3.Can using metal or aluminum foil in the microwave cause a fire?<br>4.Can microwaving nothing (an empty microwave) cause it to catch fire?<br>5.If your microwave sparks or catches fire during use, even for a few seconds.<br>6.In any case, if you smell burning plastic or food when using the microwave, book a service.<br>7.Basically, if your microwave shows smoke, flames, or burns food unusually fast.<br>8.In case your microwave door is melted, burnt, or discolored from the inside.</p><p>9.If your microwave is used near flammable items or in a tight space with poor ventilation.<br>10.In any case, if the microwaves wire or plug is burnt or damaged.</p><h4>&nbsp;</h4>', 399, 1, 0, '2025-06-13 17:48:08', '2025-08-20 12:23:08', '223.236.127.103', NULL),
(25, 10, 28, 1, 'Other Defects', 'We handle all other microwave issues such as wiring faults, display errors, and minor electrical problems. Our experts provide reliable inspection and repair to restore smooth and safe microwave operation.', '<p>So, After all this services, <strong>ARE YOU STILL CONFUSE??, </strong>then just book this other Issue section.</p>', 299, 1, 0, '2025-06-13 19:04:28', '2025-08-20 12:23:36', '223.236.127.103', NULL),
(26, 10, 27, 1, 'Door Issue', 'Door problems such as not closing, broken latch, or loose hinges affect performance and safety. Our experts repair or replace faulty door parts to restore secure and smooth functioning.', '<p><strong>Below Cases you must should book Microwave door Issue service:</strong><br>1.If your microwave door doesnt close or latch properly.</p><p>2.In any case, if the door feels loose, misaligned, or shaky.</p><p>3.Basically, if the microwave doesn\'t start because the door won\'t lock.</p><p>4.In case your door glass is cracked, loose, or damaged.</p><p>5.If you see a gap or light leaking from the door during use.</p><p>6.Sometimes, long use causes door hinges to get loose or jammed  then book service.</p><p>7.If the door makes loud noises when opening or closing.</p><p>8.If the door button or handle is broken or stuck.</p><p>9.If the microwave starts even when the door is slightly open  thats unsafe.</p><p>10.Any door-related issue you feel is unsafe or unusual  book the service.</p>', 399, 1, 0, '2025-06-13 19:09:53', '2025-08-20 12:23:59', '223.236.127.103', NULL),
(28, 10, 31, 1, 'Food Quality problem', 'If food isnt cooking evenly or properly, it may be due to faulty magnetron, uneven heating, or turntable issues. Our service ensures thorough inspection and repair for consistent food quality.', '<p><strong>Below Cases you must should book Microwave food problem service:</strong><br>1.If your food is coming out overcooked or undercooked even on normal settings.</p><p>2.In any case, if one side of the food is hot and the other side is still cold.</p><p>3.Basically, if your microwave is burning or drying out food unusually fast.</p><p>4.In case your food smells burnt or tastes strange after heating.</p><p>5.If you feel like the microwave is not heating evenly anymore.</p><p>6.Sometimes, after long use, heating quality drops and affects food  then book service.</p><p>7.In any case, if your food takes much longer to heat than before.</p><p>8.If you notice food spills often get burned and stuck  it could affect heating.</p><p>9.If pre-set cooking modes are not working properly.</p><p>10.Any type of issue related to food not heating properly  just book the service.</p>', 399, 1, 0, '2025-06-13 19:11:57', '2025-08-20 12:24:33', '223.236.127.103', NULL),
(29, 10, 29, 1, 'Noise Making', 'Unusual noise may come from turntable motor, fan, or magnetron. Our service inspects and repairs the root cause to restore quiet and smooth operation.', '<p><strong>Below Cases you must should book Microwave noise service:</strong></p><p>1.If your microwave is making loud or unusual sounds during use.</p><p>2.In any case, if you hear buzzing, grinding, or clicking noises while it runs.</p><p>3.Basically, if the microwave sound changed suddenly from normal.</p><p>4.In case the noise comes even when the microwave is idle or off.</p><p>5.If the turntable is rattling or not moving smoothly.</p><p>6.Sometimes, a faulty fan or motor can cause noise  then also book service.</p><p>7.If theres a sharp or metallic sound when heating starts.</p><p>8.If sound increases with time during each use.</p><p>9.If the noise comes from the back or inside the control panel.</p><p>10.Any kind of unusual sound issue you dont understand  book the service.</p>', 499, 1, 0, '2025-06-13 19:14:03', '2025-08-20 12:25:00', '223.236.127.103', NULL),
(30, 10, 32, 1, 'Button Not working', 'Non-working buttons or touch panels may result from wiring or control board issues. Our experts repair or replace faulty controls for smooth and easy operation.', '<p><strong>Below Cases you must should book Microwave button not working service:</strong><br>&nbsp;</p><p>&nbsp;</p><p>1.If the start, stop, or timer button is not responding at all.</p><p>2.In case any button is stuck or hard to press.</p><p>3.If only some buttons work and others don\'t respond.</p><p>4.If you notice random or incorrect inputs when pressing buttons.</p><p>5.Sometimes, moisture or internal faults cause button failure  book service if seen.</p><p>6.If you cant set the desired time or power level due to button issues.</p><p>7.Basically, if the control panel is misbehaving in any way  book a technician.<br>8.If the touchpad lights up but doesnt let you select any function.</p><p>9.If buttons respond only after pressing very hard or multiple times.</p><p>10.Any glitch in button control can affect safety and performance  service is needed.</p>', 399, 1, 0, '2025-06-14 10:23:07', '2025-08-20 12:25:47', '223.236.127.103', NULL),
(31, 10, 33, 1, 'Glass Broken', 'A broken glass tray or door glass can make your microwave unsafe. Our service provides replacement with genuine parts to restore safe usage.', '<p><strong>Below Cases you must should book Microwave glass broken service:</strong><br>1.If the glass door has cracks or is completely shattered.</p><p>2.In case the glass tray inside the microwave is broken or chipped.</p><p>3.If you see small glass shards or cracks that can be a safety hazard.</p><p>4.A broken glass can lead to uneven heating or exposure  service is a must.</p><p>5.If the door doesn\'t close properly because of damaged glass.</p><p>6.If you hear unusual noise while the microwave runs  broken glass could be the cause.</p><p>7.Any glass damage, even if minor, should be fixed by a professional.<br>8.If the broken glass is making it unsafe to use the microwave regularly.</p><p>9.A damaged tray can affect food rotation and heating quality.</p><p>10.Any type of glass breakage should be handled professionally to avoid risk.</p>', 399, 1, 0, '2025-06-14 10:25:57', '2025-08-20 12:26:21', '223.236.127.103', NULL),
(32, 10, 34, 1, 'Heating Related Issue', 'If your microwave isnt heating, it may be due to magnetron, diode, or capacitor issues. Our experts repair or replace faulty parts for quick and reliable heating.', '<p><strong>Below Cases you must should book Microwave not heating service:</strong><br>1.If your microwave turns on but doesnt heat the food at all.</p><p>2.In case the food remains cold or just slightly warm even after long heating.</p><p>3.If the magnetron or internal components fail, it leads to no heating.</p><p>4.Sometimes, sparks or burnt smell accompany the issue  dont delay service.</p><p>5.If power is fine but there\'s no heat, internal repair is needed.</p><p>6.Basically, if your microwave becomes a lightbox  time to book service.</p><p>7.Any heating issue should be checked before it worsens.<br>8.If the microwave light is on, timer works, but food remains cold.</p><p>9.Continuous use in this condition may damage internal parts further.</p><p>10.If your microwave used to heat quickly and now doesnt  get it checked.</p>', 299, 1, 0, '2025-06-14 10:29:00', '2025-08-20 12:27:02', '223.236.127.103', NULL),
(33, 10, 35, 1, 'Turntable Not Moving', 'A non-rotating turntable can result from a defective motor or roller issue. Our service ensures smooth rotation for even cooking and heating.', '<p><strong>Below Cases you must should book Microwave Turntable not moving service:</strong><br>&nbsp;</p><p>1.If your microwave tray doesnt rotate while heating.</p><p>2.In case food heats unevenly because the turntable is stuck.</p><p>3.If you hear grinding or clicking sounds from the base.</p><p>4.Sometimes, the motor or ring support may be damaged  needs a check.</p><p>5.If the turntable moves sometimes and stops randomly  book service.</p><p>6.Turntable not moving can cause overcooked spots  fix it early.</p><p>7.Any sign of turntable malfunction should be inspected by a technician.<br>8.If you manually spin the tray and it feels stuck or off-track.</p><p>9.Turntable not moving often results in cold spots in food.</p><p>10.Ignoring the issue may damage the rotating mechanism over time.</p>', 399, 1, 0, '2025-06-14 10:31:15', '2025-08-20 12:27:57', '223.236.127.103', NULL),
(34, 11, 44, 1, 'Gas Change', 'Low refrigerant gas leads to poor cooling and overload on the compressor. Our service includes leak detection, proper refilling, and pressure testing for long-lasting cooling performance.', '<p><strong>Below Cases you must should book Refrigerator Gas change service:</strong><br>1.If your fridge is not cooling like before or feels warm inside.</p><p>2.In case ice is not forming in the freezer even after long hours.</p><p>3.If you hear the compressor working but cooling is still weak.</p><p>4.If fridge items spoil quickly due to low temperature.</p><p>5.Gas leakage signs like oily residue or hissing sounds should not be ignored.</p><p>6.If the back side of the fridge is unusually cold or forming frost.</p><p>7.Long running time with poor cooling is often a gas issue.</p><p>8.If technician has previously diagnosed low gas level.</p><p>9.Cooling performance gradually dropping over days  gas top-up is likely needed.</p><p>10.Any decrease in freezing or cooling power  book a gas refill service.</p>', 399, 1, 0, '2025-06-14 12:03:13', '2025-08-20 12:30:16', '223.236.127.103', NULL),
(35, 11, 36, 1, 'Noisy Refrigerator', 'Unusual noise can result from faulty fans, loose parts, or compressor issues. Our experts inspect and repair to restore quiet and smooth refrigerator operation.', '<p><strong>Below Cases you must should book Refrigerator noise service:</strong><br>1.If your fridge makes loud humming, buzzing, or vibrating sounds.</p><p>2.In case noise increases when compressor turns on.</p><p>3.If strange clicking or popping sounds come from the back.</p><p>4.Continuous loud operation is a sign of internal fault.</p><p>5.If noise disturbs sleep or is audible from another room.</p><p>6.Noise can be caused by fan, compressor, or loose components  needs check.</p><p>7.If fridge sounds like its struggling or overloaded.</p><p>8.Rattling sound while opening/closing door.</p><p>9.If noise started suddenly after moving or shifting the fridge.</p><p>10.Any abnormal sound is an early warning  service it soon.</p>', 399, 1, 0, '2025-06-14 12:06:18', '2025-08-20 12:30:54', '223.236.127.103', NULL),
(36, 11, 37, 1, 'Runs Continuously', 'A refrigerator running non-stop may have thermostat faults, dirty coils, or gas issues. Our service ensures proper diagnosis and repair for efficient power usage.', '<p><strong>Below Cases you must should book Refrigerator runs continuously service:</strong><br>1.If your fridge never seems to turn off, even when cold.</p><p>2.In case compressor runs non-stop for hours.</p><p>3.If electricity bill has increased due to constant running.</p><p>4.It may signal thermostat or sensor issues.</p><p>5.Cooling coil or gas problem could cause nonstop operation.</p><p>6.If the fridge gets colder than needed and freezes regular food.</p><p>7.If motor sound is always on without break.</p><p>8.Overrunning can reduce lifespan of fridge components.</p><p>9.Any non-stop functioning of the fridge should be diagnosed.</p><p>10.Continuous running means its time to call for a service check.</p>', 399, 1, 0, '2025-06-14 12:08:32', '2025-08-20 12:31:31', '223.236.127.103', NULL),
(38, 11, 39, 1, 'Ice maker not working', 'Ice maker issues may be due to blocked water supply, faulty valves, or motor defects. Our service restores smooth ice-making function for uninterrupted usage.', '<p><strong>Below Cases you must should book Refrigerator Ice maker not working service:</strong><br>1.If no ice is forming even when freezer is cold.</p><p>2.Ice maker not refilling automatically after emptying.</p><p>3.In case ice cubes are too small, misshaped, or stuck.</p><p>4.If ice tray is stuck or not rotating.</p><p>5.If water supply is fine but still no ice is made.</p><p>6.No sound or activity from the ice-making unit.</p><p>7.If it overfills and causes water to leak or freeze around.</p><p>8.If ice is cloudy or has odd smell  filters or unit might be dirty.</p><p>9.Frozen or jammed mechanism inside the ice maker.</p><p>10.Ice maker not functioning properly? Book a service check-up.</p>', 299, 1, 0, '2025-06-14 12:12:14', '2025-08-20 12:32:30', '223.236.127.103', NULL),
(39, 11, 40, 1, 'Fridge Door', 'Door problems such as broken seals, hinges, or misalignment reduce cooling efficiency. Our experts repair or replace faulty door parts to ensure proper sealing and energy saving.', '<p><strong>Below Cases you must should book Refrigerator door service:</strong><br>1.If door doesnt close fully or keeps popping open.</p><p>2.In case fridge rubber gasket is torn or loose.</p><p>3.Door making creaking or cracking sound when opened.</p><p>4.If you notice warm air entering or frost building up inside.</p><p>5.If door hinge is damaged or misaligned.</p><p>6.Loose door can cause cooling loss and food spoilage.</p><p>7.Moisture around door area can mean sealing is faulty.</p><p>8.If door alarm keeps beeping without reason.</p><p>9.If fridge starts and stops when door is touched.</p><p>10.Any door-related issue affects overall performance  book service.</p>', 399, 1, 0, '2025-06-14 12:14:29', '2025-08-20 12:33:07', '223.236.127.103', NULL),
(40, 11, 41, 1, 'Overheat', 'Overheating refrigerators may be caused by blocked vents, faulty fans, or compressor stress. Our service inspects and repairs to prevent damage and restore safe operation.', '<p><strong>Below Cases you must should book Refrigerator overheating service:</strong><br>If the outer walls or sides of the fridge feel very hot.</p><p>2.Compressor getting extremely warm even during normal use.</p><p>3.In case fridge becomes hot from behind or at the base.</p><p>4.Overheating may indicate ventilation block or part failure.</p><p>5.If overheating is causing smell or warmth inside compartments.</p><p>6.Excess heat can reduce fridge efficiency and life.</p><p>7.Power consumption spikes are often due to heat issues.</p><p>8.Sudden overheating after power cut or surge.</p><p>9.If you feel unsafe touching the back of the fridge.</p><p>10.Overheating is a serious warning  book a service right away.</p>', 399, 1, 0, '2025-06-14 12:16:07', '2025-08-20 12:33:31', '223.236.127.103', NULL),
(41, 11, 42, 1, 'Temperature Problem', 'Fluctuating or inaccurate temperature may be due to thermostat or sensor faults. Our service ensures accurate temperature control for safe food storage.', '<p><strong>Below Cases you must should book Refrigerator temperature service:</strong><br>1.If fridge is too cold or not cold enough.</p><p>2.Food freezing in the fridge section or melting in freezer.</p><p>3.In case temperature settings dont respond.</p><p>4.If fridge cycles randomly between cold and warm.</p><p>5.Fluctuating temperature is bad for stored food.</p><p>6.Milk or perishables going bad faster than usual.</p><p>7.If temperature display is blank or giving wrong reading.</p><p>8.Condensation or frost inside may indicate sensor fault.</p><p>9.Freezer is fine, but fridge isnt cooling  needs diagnosis.</p><p>10.Any abnormal cooling behavior means service is needed.</p>', 399, 1, 0, '2025-06-14 12:18:04', '2025-08-20 12:34:20', '223.236.127.103', NULL),
