(44, 12, 56, 1, 'Any T/v Issue', 'We cover all other TV issues including backlight failure, software errors, and port problems. Our experts ensure quick diagnosis and long-lasting repair solutions.', '<p>So, After all this services, <strong>ARE YOU STILL CONFUSE??, </strong>then just book this other Issue section.</p>', 299, 1, 0, '2025-06-16 11:02:31', '2025-08-20 12:47:15', '223.236.127.103', NULL),
(45, 13, 61, 1, 'Cloth Wash Issue', 'If clothes arent getting cleaned properly, it may be due to weak drum movement, low water intake, or detergent issues. Our experts restore powerful and efficient washing performance.', '<p><strong>Below Cases you must should book Washing machine cloth wash service:</strong><br>1.If clothes come out dirty even after full cycle.</p><p>2.Detergent not dissolving properly during wash.</p><p>3.If lint or residue sticks to clothes.</p><p>4.Uneven washing or some clothes still dry.</p><p>5.If machine doesnt agitate properly.</p><p>6.Visible marks or stains remain post-wash.</p><p>7.If drum doesnt rotate or moves abnormally.</p><p>8.Overloading even with normal clothes.</p><p>9.If water doesnt mix well with detergent.</p><p>10.Poor washing performance? Get it serviced now.</p>', 399, 1, 0, '2025-06-16 11:16:52', '2025-08-20 12:36:45', '223.236.127.103', NULL),
(46, 13, 57, 1, 'Leaky Washer', 'Water leakage may occur due to loose hoses, faulty pumps, or damaged seals. Our experts quickly detect and fix leaks to ensure smooth and safe washing machine performance.', '<p><strong>Below Cases you must should book Washing machine leaky washer service:</strong><br>1.If water leaks from underneath or the back during or after a wash.</p><p>2.Visible puddles around the washing machine.</p><p>3.Leaking only during spin or drain cycle.</p><p>4.If door seal or gasket looks cracked or worn out.</p><p>5.Water dripping from detergent drawer.</p><p>6.Loose or damaged inlet or drain hose.</p><p>7.If machine tilts or shifts while running and causes spillage.</p><p>8.Dampness near power outlet or nearby wall.</p><p>9.Leaks increase with heavier loads.</p><p>10.Leaky washer? Dont wait  book a service now!</p>', 499, 1, 0, '2025-06-16 11:18:49', '2025-08-20 12:37:15', '223.236.127.103', NULL),
(47, 13, 64, 1, 'Liquid Issue', 'Problems in detergent or liquid dispenser may be due to clogging or valve faults. Our experts clean and repair for smooth detergent flow during wash cycles.', '<p><strong>Below Cases you must should book Washing machine liquid service:</strong><br>1.If detergent stays in drawer after wash.</p><p>2.Fabric softener not releasing in rinse cycle.</p><p>3.Spillage or overflow from dispenser drawer.</p><p>4.Bad smell from detergent area.</p><p>5.Liquid not mixing with water.</p><p>6.Hard residue or buildup in drawer.</p><p>7.If liquid leaks into drum even when off.</p><p>8.Incorrect amount of detergent being used.</p><p>9.Drawer is stuck or doesnt close.</p><p>10.Detergent issues? Book maintenance service.</p>', 399, 1, 0, '2025-06-16 11:22:45', '2025-08-20 12:37:47', '223.236.127.103', NULL),
(48, 13, 67, 1, 'Machine Earthing', 'Improper earthing may cause shocks, sparking, or unsafe operation. Our service ensures proper grounding, wiring checks, and safe electrical functioning.', '<p><strong>Below Cases you must should book Washing machine earthing service:</strong><br>1.Tingling shock when touching the machine.</p><p>2.Plug or socket getting hot during use.</p><p>3.Circuit breaker trips when machine runs.</p><p>4.If your area has unstable grounding.</p><p>5.Machine body gives static shock.</p><p>6.Burning smell from plug or back panel.</p><p>7.Visible spark when inserting plug.</p><p>8.Vibration or humming with electrical noise.</p><p>9.If technician warned about earthing earlier.</p><p>10.Stay safe! Book machine earthing service now.</p>', 399, 1, 0, '2025-06-16 11:24:54', '2025-08-20 12:38:13', '223.236.127.103', NULL),
(49, 13, 65, 1, 'Machine Smell', 'Unpleasant smell in washing machines often comes from mold, detergent residue, or stagnant water inside the drum. Our service includes deep cleaning, drum sanitization, and filter checks to ensure fresh, hygienic, and odor-free washing.', '<p><strong>Below Cases you must should book Washing machine smell service:</strong><br>1.Foul or musty smell from drum or clothes.</p><p>2.Bad odor even after running empty wash.</p><p>3.If drain or filter smells unpleasant.</p><p>4.Moldy or stale smell near door seal.</p><p>5.Smell returns quickly after cleaning.</p><p>6.If detergent drawer smells sour.</p><p>7.Wet smell despite clothes being dry.</p><p>8.If machine smells burnt or electrical.</p><p>99.Odor spreads to laundry area.</p><p>10.Smelly washer? Book deep cleaning service.</p>', 399, 1, 0, '2025-06-16 11:28:38', '2025-08-20 12:39:04', '223.236.127.103', NULL),
(50, 13, 59, 1, 'Not draining', 'Drainage problems often occur due to clogged pipes, faulty pumps, or blocked filters. Our experts clean and repair to restore smooth water drainage.', '<p><strong>Below Cases you must should book Washing machine not draining service:</strong><br>1.If water remains in drum after wash.</p><p>2.Drain pipe clogged or backflow observed.</p><p>3.Error codes related to drainage appear.</p><p>4.Drain pump sound but no water exits.</p><p>5.Slow or partial draining at end of cycle.</p><p>6.Smelly water left in machine.</p><p>7.Clothes overly wet after spin.</p><p>8.Leaking from drain hose area.</p><p>9.If water stays even after multiple attempts.</p><p>10.Drain issues? Book immediate assistance.</p>', 399, 1, 0, '2025-06-16 11:37:01', '2025-08-20 12:39:56', '223.236.127.103', NULL),
(51, 13, 58, 1, 'Not Spinning', 'Spin issues may occur due to faulty motor, worn-out belt, load imbalance, or sensor faults. Our experts inspect, repair, and replace defective parts to restore smooth, efficient, and reliable spinning performance.', '<p><strong>Below Cases you must should book Washing machine not spinning service:</strong><br>1.If machine powers on but doesnt spin.</p><p>2.Clothes come out soaking wet every time.</p><p>3.Loud hum but no movement during spin.</p><p>4.Display shows error but drum doesnt rotate.</p><p>5.If machine lights on but does not start at all.</p><p>6.Cycle gets stuck and doesnt progress.</p><p>7.Drain pump works but spin doesnt activate.</p><p>8.No vibration or drum movement in spin stage.</p><p>9.Drainage works but machine fails to power up.</p><p>10.Not spinning or draining? Book expert service.</p>', 399, 1, 0, '2025-06-16 11:38:43', '2025-08-20 12:42:08', '223.236.127.103', NULL),
(52, 13, 60, 1, 'Not starting', 'A washer not starting may face wiring faults, switch problems, or motor issues. Our service diagnoses and repairs to bring your machine back to working condition.', '<p><strong>Below Cases you must should book Washing machine not starting service:</strong><br>1.If your washing machine doesn\'t respond after pressing the power button.</p><p>2.Display or lights not turning on even when plugged in.</p><p>3.Machine starts then shuts off immediately.</p><p>4.Sudden failure to start after a power cut or voltage fluctuation.</p><p>5.If door lock is fine but machine still doesn\'t start.</p><p>6.Power socket works with other appliances but not with washer.</p><p>7.Buttons are unresponsive or touchscreen panel is dead.</p><p>8.Machine shows error code but doesnt begin the wash cycle.</p><p>9.Burning smell or clicking sound when trying to start.</p><p>10.Washer not powering on? Book professional inspection service now.</p>', 499, 1, 0, '2025-06-16 11:41:36', '2025-08-20 12:42:41', '223.236.127.103', NULL),
(53, 13, 69, 1, 'Other problems', 'We cover all other washing machine issues like noise, overheating, or display faults. Our experts ensure complete inspection and dependable solutions for smooth operation.', '<p>So, After all this services, <strong>ARE YOU STILL CONFUSE??, </strong>then just book this other Issue section.</p>', 299, 1, 0, '2025-06-16 11:43:07', '2025-08-20 12:43:07', '223.236.127.103', NULL),
(54, 13, 68, 1, 'Ripped clothes', 'Torn or damaged clothes may result from rough drum movement, sharp edges, or faulty parts. Our service repairs and smoothens machine function to ensure safe, gentle washing.', '<p><strong>Below Cases you must should book Washing machine ripped clothes service:</strong><br>1.Clothes come out torn, snagged or damaged.</p><p>2.If drum edges feel sharp or rough.</p><p>3.Zippers/buttons often break in wash.</p><p>4.Fabric threads get pulled during cycle.</p><p>5.If damage happens even with light clothing.</p><p>6.Drum or paddle parts appear loose or misaligned.</p><p>7.If clothes wrap tightly and stretch.</p><p>8.If drum spins unusually or makes noise.</p><p>9.Torn clothes even after delicate setting.</p><p>10.Ripping your clothes? Lets fix it fast.</p>', 399, 1, 0, '2025-06-16 11:44:55', '2025-08-20 12:43:49', '223.236.127.103', NULL),
(55, 13, 63, 1, 'Sensor problem', 'Defective sensors can cause incorrect water levels, wash cycles, or load detection. Our service repairs or replaces faulty sensors for accurate washing performance.', '<p><strong>Below Cases you must should book Washing machine senser sound service:</strong><br>1.Incorrect water level detected by machine.</p><p>2.Washing cycle doesnt start or pause randomly.</p><p>3.If machine doesnt recognize lid or door closing.</p><p>4.Drum doesnt spin but power is on.</p><p>5.Wrong temperature or load detected.</p><p>6.Continuous beep or flashing lights.</p><p>7.Error code related to sensors showing up.</p><p>8.Water keeps filling or draining without stop.</p><p>9.If machine doesnt respond to touch.</p><p>10.Book sensor diagnosis and repair now.</p>', 399, 1, 0, '2025-06-16 11:46:39', '2025-08-20 12:44:36', '223.236.127.103', NULL),
(56, 13, 62, 1, 'Water drain', 'Improper water drainage may be caused by clogged hoses, faulty pumps, or filter blockages. Our service ensures proper cleaning and repair for smooth water flow.', '<p><strong>Below Cases you must should book Washing machine water drain service:</strong><br>1.If water remains in drum after wash.</p><p>2.Drain pipe clogged or backflow observed.</p><p>3.Error codes related to drainage appear.</p><p>4.Drain pump sound but no water exits.</p><p>5.Slow or partial draining at end of cycle.</p><p>6.Smelly water left in machine.</p><p>7.Clothes overly wet after spin.</p><p>8.Leaking from drain hose area.</p><p>9.If water stays even after multiple attempts.</p><p>10.Drain issues? Book immediate assistance.</p>', 399, 1, 0, '2025-06-16 12:02:49', '2025-08-20 12:45:07', '223.236.127.103', NULL),
(59, 12, 46, 1, 'Audio problem', 'No sound or distorted audio can result from speaker faults, wiring issues, or motherboard damage. Our experts repair or replace components for clear, balanced sound output.', '<p><strong>Below Cases you must should book T/V Audio problem service:</strong><br>&nbsp;</p><p>1.No sound even though volume is up.</p><p>&nbsp;</p><p>2.Sound cuts off randomly during use.</p><p>&nbsp;</p><p>3.Speakers crackle, buzz, or distort.</p><p>&nbsp;</p><p>4.TV volume too low even at max.</p><p>&nbsp;</p><p>5.Audio delay or mismatch with video.</p><p>&nbsp;</p><p>6.Echo or static in built-in speakers.</p><p>&nbsp;</p><p>7.TV detects no external audio devices.</p><p>&nbsp;</p><p>8.Sound disappears after changing input.</p><p>&nbsp;</p><p>9.Audio works only with headphones.</p><p>&nbsp;</p><p>10.Audio issues? Book speaker/audio repair now.</p>', 399, 1, 0, '2025-06-16 12:12:32', '2025-08-20 12:47:57', '223.236.127.103', NULL),
(60, 12, 49, 1, 'Control disk problem', 'Faulty control disk can cause difficulty in adjusting settings. Our experts repair or replace defective parts to restore smooth and easy TV operation.', '<p><strong>Below Cases you must should book t/v control disk service:</strong><br>&nbsp;</p><p>1.Volume or channel changes randomly on its own.</p><p>&nbsp;</p><p>2.Control buttons on TV are unresponsive or stuck.</p><p>&nbsp;</p><p>3.TV keeps going to menu or changes input without touching.</p><p>&nbsp;</p><p>4.On-screen functions trigger without remote input.</p><p>&nbsp;</p><p>5.Unable to manually turn TV on/off or adjust settings.</p><p>&nbsp;</p><p>6.Physical controls feel loose or broken.</p><p>&nbsp;</p><p>7.Touch panel not detecting finger input.</p><p>&nbsp;</p><p>8.TV control panel lights blink continuously.</p><p>&nbsp;</p><p>9.Settings change automatically or keep resetting.</p><p>&nbsp;</p><p>10.Book now to fix faulty TV control disk/buttons.</p>', 399, 1, 0, '2025-06-16 12:14:58', '2025-08-20 12:48:23', '223.236.127.103', NULL),
(61, 12, 52, 1, 'Distortion Issue', 'Distorted images or colors may occur due to signal issues, cable faults, or panel damage. Our service restores sharp and clear display quality.', '<p><strong>Below Cases you must should book T/V Distortion Issue service:</strong><br><br>1.Screen shows wavy, pixelated, or distorted visuals.</p><p><br>2.Color patches or lines appear suddenly.</p><p><br>3.Sound is okay but image is blurry or flickering.</p><p><br>4.Horizontal/vertical tearing during movement.</p><p><br>5.Screen shows double or ghosted images.</p><p>&nbsp;</p><p>6.Color mismatch or excessive brightness contrast.</p><p>&nbsp;</p><p>7.TV displays image for a few seconds, then distorts.</p><p>&nbsp;</p><p>8.Distortion worsens with HDMI or input changes.</p><p>&nbsp;</p><p>9.Image shakes or vibrates while playing content.</p><p>&nbsp;</p><p>10.Facing visual distortion? Book a technician today.</p>', 399, 1, 0, '2025-06-16 12:17:01', '2025-08-20 12:48:59', '223.236.127.103', NULL);
INSERT INTO `Rate` (`rate_id`, `cate_id`, `subcate_id`, `city_id`, `title`, `description`, `how_it_work_description`, `amount`, `iStatus`, `isDelete`, `created_at`, `updated_at`, `strIP`, `time`) VALUES
(62, 12, 51, 1, 'Motherboard Fault', 'TV motherboard issues can cause display errors, sound faults, or complete failure. Our experts diagnose and repair PCB and chips for smooth performance.', '<p><strong>Below Cases you must should book T/V Motherboard fault service:</strong><br><br>1.TV turns on but no image or sound appears.</p><p><br>2.Random reboots, freezes or unresponsive screen.</p><p><br>3.HDMI ports not detecting devices.</p><p><br>4.Backlight is on but screen is blank.</p><p><br>5.Continuous blinking light on front panel.</p><p><br>6.No response from remote or manual buttons.</p><p><br>7.Multiple functions fail at once (audio + video).</p><p><br>8.Display goes black while sound remains.</p><p><br>9.TV only boots into logo screen then freezes.</p><p><br>10.Suspect motherboard fault? Book expert service now.</p>', 399, 1, 0, '2025-06-16 12:21:33', '2025-08-20 12:49:30', '223.236.127.103', NULL),
(63, 12, 53, 1, 'ON/OFF', 'TV not switching on/off may be caused by power faults, motherboard issues, or wiring problems. Our experts provide safe inspection and repair for smooth functioning.', '<p><strong>Below Cases you must should book T/V ON/OFF service:</strong><br><br>1.TV doesnt turn on even after multiple tries.</p><p><br>2.TV turns off automatically after a few seconds.</p><p><br>3.Random restart or shutdown during usage.</p><p><br>4.Power button doesnt respond at all.</p><p><br>5.Indicator light blinks but screen stays black.</p><p><br>6.TV starts but goes blank immediately.</p><p><br>7.Remote or manual controls dont power it on.</p><p><br>8.ON/OFF takes a long delay or feels stuck.</p><p><br>9.Only works after unplugging and replunging.</p><p><br>10.Book now for ON/OFF troubleshooting and fix.</p>', 399, 1, 0, '2025-06-16 12:24:28', '2025-08-20 12:49:53', '223.236.127.103', NULL),
(64, 12, 50, 1, 'Plug-wire problem', 'Plug-in or connectivity issues may result from faulty ports, wiring, or loose sockets. Our service ensures proper repair and replacement for reliable connections.', '<p><strong>Below Cases you must should book T/V Plug-in problems service:</strong><br><br>1.TV plug feels loose or unstable in socket.</p><p><br>2.Sparks or burning smell from plug area.</p><p><br>3.cuts when the plug is moved.</p><p><br>4.Plug gets too hot during operation.</p><p><br>5.TV works only with specific angle of plug.</p><p><br>6.Adapter cable is torn, damaged or twisted.</p><p><br>7.Visible melting or dark burn marks.</p><p><br>8.TV stops working after recent socket change.</p><p><br>9.Wall socket trips when TV is plugged in.</p><p><br>10.Safety first! Book plug or cable repair today.</p>', 399, 1, 0, '2025-06-16 12:26:30', '2025-08-20 12:50:31', '223.236.127.103', NULL),
(65, 12, 45, 1, 'Remote control Issues', 'Remote not working may be caused by sensor faults, battery issues, or signal problems. Our service ensures smooth pairing, sensor repair, and replacement for easy operation.', '<p><strong>Below Cases you must should book T/V Remote control issues service:</strong><br><br>1.TV doesnt respond to remote commands.</p><p><br>2.You have to press buttons multiple times to work.</p><p><br>3.Remote only works from a very short distance.</p><p><br>4.Some buttons dont function at all.</p><p><br>5.If IR sensor on TV or remote is damaged.</p><p><br>6.Battery drains too quickly or sparks inside.</p><p><br>7.Remote lags or controls randomly.</p><p><br>8.Only power button works, rest are unresponsive.</p><p><br>9.Remote works for other devices but not this TV.</p><p><br>10.Remote acting up? Book a quick remote diagnosis.</p>', 399, 1, 0, '2025-06-16 12:28:46', '2025-08-20 12:51:07', '223.236.127.103', NULL),
(66, 12, 48, 1, 'Screen glass damage', 'Broken or cracked TV glass affects both safety and viewing experience. Our service provides expert glass or panel replacement with genuine parts to restore clear visuals and safe, long-lasting performance.', '<p><strong>Below Cases you must should book T/V Screen glass damage service:</strong><br><br>1.Cracked or shattered screen glass.</p><p><br>2.Screen glass is broken but panel shows display.</p><p><br>3.Black spots or discoloration from internal crack.</p><p><br>4.Touch screen glass not responding (for smart TVs).</p><p><br>5.Spider-web cracks affecting view.</p><p><br>6.Visible dent or damage from impact.</p><p><br>7.Outer layer peeling or discolored.</p><p><br>8.Glass coming off from the panel.</p><p><br>9.Sharp edges or pieces around screen area.</p><p><br>10.Broken screen? Book screen glass replacement now.</p>', 399, 1, 0, '2025-06-16 12:35:23', '2025-08-20 12:52:14', '223.236.127.103', NULL),
(67, 12, 47, 1, 'Screen line', 'Horizontal or vertical lines on the screen may be due to panel faults, loose cables, or T-CON board issues. Our service restores clear and smooth display quality.', '<p><strong>Below Cases you must should book T/V Screen line service:</strong><br><br>1.Horizontal or vertical lines visible on the screen.</p><p><br>2.Lines appear suddenly while watching.</p><p><br>3.Screen shows color bands or ghost lines.</p><p>&nbsp;</p><p>4.Lines worsen with time or movement.</p><p><br>5.Flickering lines during brightness shift.</p><p><br>6.One part of screen completely shows lines.</p><p><br>7.Temporary lines that disappear and reappear.</p><p><br>8.Patterned or diagonal pixel defects.</p><p><br>9.Multiple lines forming a grid or patch.</p><p><br>10.Screen lines? Book line detection &amp; repair service now.</p>', 399, 1, 0, '2025-06-16 12:37:43', '2025-08-20 12:52:51', '223.236.127.103', NULL),
(68, 12, 54, 1, 'T/V Overheating', 'Overheating may be caused by blocked vents, power supply faults, or motherboard stress. Our service ensures proper cleaning, cooling, and repairs to prevent further damage.', '<p><strong>Below Cases you must should book T/V overheating service:</strong><br><br>1.TV becomes very hot during use.</p><p><br>2.Back panel heats up even on standby.</p><p><br>3.TV shuts off automatically after heating.</p><p><br>4.Screen flickers after being on for long.</p><p><br>5.You notice burning smell or unusual warmth.</p><p><br>6.Heat affects image or sound quality.</p><p><br>7.TV becomes noisy as it gets hotter.</p><p><br>8.Power brick or adapter overheats.</p><p><br>9.Backlight dims due to thermal issues.</p><p><br>10.Prevent damage! Book overheating service now.</p>', 399, 1, 0, '2025-06-16 12:40:26', '2025-08-20 12:53:27', '223.236.127.103', NULL),
(69, 12, 55, 1, 'T/V Power supply', 'Power supply issues can cause flickering, sudden shutdown, or no power. Our experts repair or replace faulty SMPS or power boards to restore reliable functioning.', '<p><strong>Below Cases you must should book T/V power supply service:</strong><br><br>1.TV doesnt start even with stable electricity.</p><p><br>2.Sudden shutdown during power fluctuations.</p><p><br>3.TV works on inverter but not on direct supply.</p><p><br>4.Blinking red light but no picture.</p><p><br>5.TV needs repeated unplugging to turn on.</p><p><br>6.Fuse or internal circuit keeps tripping.</p><p><br>7.Power brick emits noise or heat.</p><p><br>8.Display dims or flickers due to unstable power.</p><p><br>9.TV restarts frequently on its own.</p><p><br>10.Suspect power issue? Book expert service now.</p>', 399, 1, 0, '2025-06-16 12:44:07', '2025-08-20 12:54:06', '223.236.127.103', NULL),
(70, 14, 73, 1, 'Hot Water Issue', 'If hot water is not working, it may be due to heating coil, thermostat, or electrical faults. Our experts repair or replace faulty parts to restore safe and consistent hot water supply.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your dispenser is not heating water at all.</strong></p><p><strong>2.In case hot water comes only lukewarm.</strong></p><p><strong>3.If hot water takes too long to heat.</strong></p><p><strong>4.If dispenser heats water too much and unsafe.</strong></p><p><strong>5.When hot water supply stops suddenly.</strong></p><p><strong>6.If heating light shows ON but water remains cold.</strong></p><p><strong>7.In case hot water is inconsistent (sometimes hot, sometimes not).</strong></p><p><strong>8.If hot water tastes/smells unusual.</strong></p><p><strong>9.If hot water flow is too slow or blocked.</strong></p><p><strong>10.Any hot water issue you feel, book the service.</strong></p>', 299, 1, 0, '2025-08-18 09:51:40', '2025-08-20 12:08:12', '223.236.127.103', NULL),
(71, 14, 74, 1, 'Cold Water Problem', 'If your dispenser is not cooling, it may be caused by compressor, thermostat, or refrigerant issues. Our experts repair or replace faulty components to restore chilled water supply.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your dispenser is not cooling water at all.</strong></p><p><strong>2.In case cold water is only normal temperature.</strong></p><p><strong>3.If cold water takes too long to cool.</strong></p><p><strong>4.If dispenser cools water too much (ice formation).</strong></p><p><strong>5.When cold water supply suddenly stops.</strong></p><p><strong>6.If cooling light shows ON but water not cold.</strong></p><p><strong>7.In case cold water is inconsistent.</strong></p><p><strong>8.If cold water tastes/smells unusual.</strong></p><p><strong>9.If cold water flow is very low.</strong></p><p><strong>10.Any cold water issue you feel, book the service.</strong></p>', 399, 1, 0, '2025-08-18 09:57:21', '2025-08-20 12:06:37', '223.236.127.103', NULL),
(72, 14, 75, 1, 'Short Circuit- Wire', 'Short circuits can occur due to faulty wiring, loose connections, or water leakage. Our experts provide safe inspection and repair to prevent hazards and restore normal functioning.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your dispenser trips MCB/fuse frequently.</strong></p><p><strong>2.In case dispenser sparks inside body.</strong></p><p><strong>3.If dispenser stops working due to electrical fault.</strong></p><p><strong>4.If dispenser switch board burns while using.</strong></p><p><strong>5.When dispenser wire inside is burnt/damaged.</strong></p><p><strong>6.If dispenser smells like burning wires.</strong></p><p><strong>7.In case dispenser heating/cooling stops due to short circuit.</strong></p><p><strong>8.If dispenser light flickers due to wiring issue.</strong></p><p><strong>9.If plug/cord gets overheated or burnt.</strong></p><p><strong>10.Any short circuit/electrical issue, book the service.</strong></p>', 399, 1, 0, '2025-08-18 09:59:37', '2025-08-20 12:04:33', '223.236.127.103', NULL),
(73, 14, 76, 1, 'Dispenser Leak', 'Water leakage may result from loose pipes, cracked bottles, or damaged valves. Our service fixes leaks, replaces faulty parts, and ensures proper sealing for a leak-free experience.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your dispenser leaks water from tap.</strong></p><p><strong>2.In case dispenser leaks from bottom.</strong></p><p><strong>3.If dispenser tank leaks continuously.</strong></p><p><strong>4.If water drips even when not in use.</strong></p><p><strong>5.When dispenser tap valve is damaged causing leakage.</strong></p><p><strong>6.If pipe connection inside dispenser is leaking.</strong></p><p><strong>7.In case dispenser body cracked, water leaking outside.</strong></p><p><strong>8.If dispenser leaks while bottle replacement.</strong></p><p><strong>9.If water collects under dispenser frequently.</strong></p><p><strong>10.Any water leakage problem you feel, book the service.</strong></p>', 399, 1, 0, '2025-08-18 10:02:18', '2025-08-20 12:01:22', '223.236.127.103', NULL),
(74, 14, 77, 1, 'Unusual Noise', 'Unusual sounds in dispensers may indicate motor, compressor, or fan issues. Our service ensures complete inspection, lubrication, and repair to restore smooth and quiet operation.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your dispenser makes strange noise while running.</strong></p><p><strong>2.In case dispenser makes loud humming noise.</strong></p><p><strong>3.If dispenser vibrates and makes sound.</strong></p><p><strong>4.If dispenser makes buzzing sound while cooling/heating.</strong></p><p><strong>5.When dispenser motor makes unusual sound.</strong></p><p><strong>6.If dispenser noise increases with use.</strong></p><p><strong>7.In case dispenser fan makes rattling sound.</strong></p><p><strong>8.If dispenser makes cracking sound during cooling.</strong></p><p><strong>9.If dispenser gurgling sound from water line.</strong></p><p><strong>10.Any unusual noise you feel from dispenser, book the service.</strong></p>', 499, 1, 0, '2025-08-18 10:03:21', '2025-08-20 11:59:40', '223.236.127.103', NULL),
(75, 14, 78, 1, 'smell or bad taste', 'Bad taste or smell usually comes from dirty tanks, pipes, or stagnant water. Our service includes deep cleaning, sanitization, and filter replacement for safe, fresh, and clean-tasting water.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If water from dispenser smells bad/unpleasant.</strong></p><p><strong>2.In case water tastes metallic or salty.</strong></p><p><strong>3.If water has plastic-like smell.</strong></p><p><strong>4.If dispenser water tastes bitter or unusual.</strong></p><p><strong>5.When dispenser smells due to unclean tank.</strong></p><p><strong>6.If dispenser gives foul smell after long non-use.</strong></p><p><strong>7.In case bacteria buildup causes bad smell.</strong></p><p><strong>8.If filters inside are damaged causing bad taste.</strong></p><p><strong>9.If water smells after heating/cooling.</strong></p><p><strong>10.Any bad taste or smell problem, book the service.</strong></p>', 399, 1, 0, '2025-08-18 10:09:17', '2025-08-20 11:58:22', '223.236.127.103', NULL),
(76, 14, 79, 1, 'Light Issue', 'Non-working indicator lights may result from faulty wiring, LED failure, or PCB issues. Our experts diagnose and repair to restore proper display and easy operation.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your dispenser indicator lights do not glow.</strong></p><p><strong>2.In case hot/cold indicators not working.</strong></p><p><strong>3.If dispenser power light off despite working.</strong></p><p><strong>4.If lights flicker but do not stay ON.</strong></p><p><strong>5.When indicator lights show wrong status.</strong></p><p><strong>6.If LED lights are dim or very weak.</strong></p><p><strong>7.In case light switches on/off automatically.</strong></p><p><strong>8.If indicator bulbs are fused/damaged.</strong></p><p><strong>9.If panel lights not functioning properly.</strong></p><p><strong>10.Any light indicator problem, book the service.</strong></p>', 299, 1, 0, '2025-08-18 10:20:38', '2025-08-20 11:56:49', '223.236.127.103', NULL),
