(78, 14, 81, 1, 'Water Flow Problem', 'Low or irregular water flow may be due to clogged pipes, valve defects, or pump issues. Our service ensures smooth water dispensing with cleaning and proper part replacement.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your dispenser water flow is too slow.</strong></p><p><strong>2.In case dispenser does not give water at all.</strong></p><p><strong>3.If water comes drop by drop.</strong></p><p><strong>4.If water stops suddenly while filling.</strong></p><p><strong>5.When flow is uneven or splashing.</strong></p><p><strong>6.If tap is blocked causing low flow.</strong></p><p><strong>7.In case pump not working reducing water flow.</strong></p><p><strong>8.If air bubbles in line disturb flow.</strong></p><p><strong>9.If water pressure very weak despite full tank.</strong></p><p><strong>10.Any water flow issue you feel, book the service.</strong></p>', 399, 1, 0, '2025-08-18 10:22:48', '2025-08-20 11:54:35', '223.236.127.103', NULL),
(79, 14, 82, 1, 'Other Dispenser', 'We cover all other dispenser issues like low water flow, power supply problems, and sensor faults. Our experts ensure complete inspection and effective solutions for reliable, long-lasting performance.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If water bottle not fitting properly.</strong></p><p><strong>2.If air bubbles block water flow.</strong></p><p><strong>3.In case body cover is broken/damaged.</strong></p><p><strong>4.If tap lever is loose or broken.</strong></p><p><strong>5.If dispenser consumes more electricity than normal.</strong></p><p><strong>6.When dispenser stops automatically during use.</strong></p><p><strong>7.If dispenser gives electric shock when touched.</strong></p><p><strong>8.In case cooling/heating fan not working.</strong></p><p><strong>9.If dispenser plastic parts making noise.</strong></p><p><strong>10.Any other unusual issue you feel in dispenser, book the service.</strong></p>', 299, 1, 0, '2025-08-18 10:27:29', '2025-08-20 11:50:38', '223.236.127.103', NULL),
(80, 15, 83, 1, 'Water Bad taste', 'Bad taste in purified water usually indicates worn-out filters, dirty membranes, or stagnant storage. Our service includes filter replacement and deep cleaning to restore fresh, safe, and great-tasting water.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your purifier water tastes unusual/bitter.</strong></p><p><strong>2.In case water tastes salty even after purification.</strong></p><p><strong>3.If water tastes metallic or chemical-like.</strong></p><p><strong>4.If purifier water has muddy taste.</strong></p><p><strong>5.When purifier filters are expired causing bad taste.</strong></p><p><strong>6.If purifier water smells bad while drinking.</strong></p><p><strong>7.In case purifier RO membrane is faulty.</strong></p><p><strong>8.If purifier UV/UF not working, water tastes different.</strong></p><p><strong>9.If bad taste increases after long use without service.</strong></p><p><strong>10.Any unusual taste issue in water, book the service.</strong></p>', 399, 1, 0, '2025-08-18 11:12:08', '2025-08-20 11:48:17', '223.236.127.103', NULL),
(81, 15, 84, 1, 'Not turning on', 'A purifier that doesnt power on may face electrical faults, wiring issues, or defective PCB. Our service identifies the root cause and provides fast, safe repairs for uninterrupted operation.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your purifier does not start at all.</strong></p><p><strong>2.In case power supply is fine but purifier not turning on.</strong></p><p><strong>3.If your purifier indicator lights do not glow.</strong></p><p><strong>4.If your purifier switch/power button is not working.</strong></p><p><strong>5.When your purifier turns on for a second then shuts off.</strong></p><p><strong>6.If your purifier MCB/fuse trips on turning ON.</strong></p><p><strong>7.In case purifier adapter/SMPS is faulty.</strong></p><p><strong>8.If your purifier not turning on even after restart/reset.</strong></p><p><strong>9.If your purifier panel not responding.</strong></p><p><strong>10.Any type of power ON issue you feel, book the service.</strong></p>', 399, 1, 0, '2025-08-18 11:13:00', '2025-08-20 11:47:03', '223.236.127.103', NULL),
(82, 15, 85, 1, 'Making noise', 'Unusual noise from purifiers can result from faulty pumps, air gaps, or motor problems. Our service ensures proper inspection and repair for smooth and quiet functioning.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your purifier makes unusual sound while running.</strong></p><p><strong>2.In case purifier pump makes loud humming noise.</strong></p><p><strong>3.If purifier makes rattling or vibration sound.</strong></p><p><strong>4.If purifier makes continuous noise while filtering water.</strong></p><p><strong>5.When purifier makes loud sound during tank filling.</strong></p><p><strong>6.If purifier motor makes buzzing noise.</strong></p><p><strong>7.In case purifier noise increases with water flow.</strong></p><p><strong>8.If purifier makes gurgling sound from pipes.</strong></p><p><strong>9.If purifier makes strange sound after filter replacement.</strong></p><p><strong>10.Any type of noise issue you feel from purifier, book the service.</strong></p>', 499, 1, 0, '2025-08-18 11:14:13', '2025-08-20 11:45:07', '223.236.127.103', NULL),
(83, 15, 86, 1, 'Purify Leaking', 'Water leakage often results from loose joints, damaged pipes, or faulty taps. Our experts quickly fix leaks, replace damaged parts, and ensure a long-lasting, leak-free purifier.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your purifier leaks water from tap continuously.</strong></p><p><strong>2.In case your purifier leaks from body joints.</strong></p><p><strong>3.If purifier tank water drips even when not in use.</strong></p><p><strong>4.If purifier tap valve is broken/damaged causing leakage.</strong></p><p><strong>5.When purifier pipe connections leak water.</strong></p><p><strong>6.If purifier cartridge housing leaks during filtration.</strong></p><p><strong>7.In case purifier leaks while filling water bottle.</strong></p><p><strong>8.If purifier tank leaks due to crack.</strong></p><p><strong>9.If purifier leaks inside cabinet causing mess.</strong></p><p><strong>10.Any leakage issue from purifier body or tap, book the service.</strong></p>', 299, 1, 0, '2025-08-18 11:17:13', '2025-08-20 11:43:35', '223.236.127.103', NULL),
