(87, 16, 89, 1, 'Leaking Geyser', 'Water leakage from the geyser tank indicates cracks, rust, or valve issues. Our experts repair or replace faulty parts, ensuring safe operation and preventing water wastage or damage.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your geyser leaks water from bottom.</strong></p><p><strong>2.In case your geyser leaks from side joints.</strong></p><p><strong>3.If your geyser tank drips continuously.</strong></p><p><strong>4.If your geyser water leaks only when heating.</strong></p><p><strong>5.When your geyser overflows due to pressure valve issue.</strong></p><p><strong>6.If your geyser tank has cracks or rust leakage.</strong></p><p><strong>7.In case your geyser pipe connection leaks water.</strong></p><p><strong>8.If your geyser leaks water and damages wall/paint.</strong></p><p><strong>9.If your geyser water leaks inside electrical parts.</strong></p><p><strong>10.Any type of leakage problem from geyser, book the service.</strong></p>', 399, 1, 0, '2025-08-19 09:32:39', '2025-08-20 11:24:25', '223.236.127.103', NULL),
(88, 16, 88, 1, 'No hot water', 'If your geyser isnt heating, it may be due to heating element failure, thermostat issues, or wiring faults. Our experts repair or replace faulty parts to restore quick and reliable hot water supply.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your geyser is not heating water at all.</strong></p><p><strong>2.In case your geyser runs but only gives cold water.</strong></p><p><strong>3.If your geyser heats for a very long time but still no hot water.</strong></p><p><strong>4.If your geyser switch light is ON but water not heating.</strong></p><p><strong>5.When your geyser heating element is faulty.</strong></p><p><strong>6.If your geyser gives only lukewarm water instead of hot.</strong></p><p><strong>7.If your geyser suddenly stops heating after few minutes.</strong></p><p><strong>8.In case your geyser water remains cold even after long use.</strong></p><p><strong>9.If geyser trips frequently while heating.</strong></p><p><strong>10.Any condition where geyser does not give hot water, book the service.</strong></p>', 499, 1, 0, '2025-08-19 09:33:16', '2025-08-20 11:22:02', '223.236.127.103', NULL),
