(91, 16, 92, 1, 'Temperature Problem', 'Fluctuating water temperature may be due to thermostat problems, wiring faults, or heating element damage. Our service ensures accurate temperature control for steady, reliable hot water supply.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your geyser water temperature keeps fluctuating.</strong></p><p><strong>2.In case your geyser gives too hot water suddenly.</strong></p><p><strong>3.If your geyser heats too slowly and then overheats.</strong></p><p><strong>4.If your geyser temperature is not steady during bath.</strong></p><p><strong>5.When your geyser thermostat is faulty.</strong></p><p><strong>6.If your geyser gives alternate hot and cold water.</strong></p><p><strong>7.In case your geyser temperature setting does not work.</strong></p><p><strong>8.If your geyser heats very high even on low setting.</strong></p><p><strong>9.If your geyser fails to maintain steady heating.</strong></p><p><strong>10.Any inconsistent heating issue you feel, book the service.</strong></p>', 399, 1, 0, '2025-08-19 09:37:24', '2025-08-20 11:12:36', '223.236.127.103', NULL),
(92, 17, 95, 1, 'Not enough cooling', 'Low cooling may be caused by dirty pads, low water levels, or motor issues. Our experts clean, check, and repair all parts to restore strong, refreshing, and efficient cooling.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your cooler is running but not giving enough cooling.</strong></p><p><strong>2.If your cooler throws only normal/hot air instead of cool air.</strong></p><p><strong>3.In case your cooler cools only for a short time then stops.</strong></p><p><strong>4.If your cooler does not spread cooling in the whole room.</strong></p><p><strong>5.When your cooler cooling pads are dry or damaged.</strong></p><p><strong>6.If your cooler fan runs but air is not cool.</strong></p><p><strong>7.If your cooler airflow is too weak.</strong></p><p><strong>8.In case your cooler cools only when sitting very close.</strong></p><p><strong>9.If your cooler water pump is not working properly.</strong></p><p><strong>10.Any type of low cooling problem you feel, book the service.</strong></p>', 399, 1, 0, '2025-08-19 09:48:07', '2025-08-20 11:09:19', '223.236.127.103', NULL),
(93, 17, 96, 1, 'Cooler Water leaking', 'Water leakage in coolers can happen due to cracks, loose pipes, or faulty pumps. Our experts quickly identify the problem, fix leaks, and ensure smooth water circulation for efficient and trouble-free cooling.', '<p><strong>Below cases you should book service:&nbsp;</strong></p><p>&nbsp;</p><p><strong>1.If your cooler leaks water from the bottom tray.</strong></p><p><strong>2.In case cooler leaks from the water tank.</strong></p><p><strong>3.If water overflows while filling.</strong></p><p><strong>4.When water drips continuously from side panels.</strong></p><p><strong>5.If pipe connection inside cooler is broken causing leakage.</strong></p><p><strong>6.In case float valve not working, leading to overflow.</strong></p><p><strong>7.If cooler leaks during water pump use.</strong></p><p><strong>8.If cooler body cracked or damaged, water comes out.</strong></p><p><strong>9.If water collects under the cooler after few minutes.</strong></p><p><strong>10.Any type of water leakage issue you notice, book the service.</strong></p>', 399, 1, 0, '2025-08-19 09:48:55', '2025-08-20 11:06:35', '223.236.127.103', NULL),
(94, 17, 97, 1, 'ON/OFF Issue', 'If your cooler has ON/OFF issues, it may be due to faulty switches, wiring, or power supply. Our experts quickly diagnose and repair for hassle-free operation.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your cooler does not turn ON.</strong></p><p><strong>2.In case your cooler does not switch OFF.</strong></p><p><strong>3.If your cooler turns ON but stops suddenly.</strong></p><p><strong>4.If your cooler needs multiple tries to switch ON.</strong></p><p><strong>5.When your cooler power button works sometimes only.</strong></p><p><strong>6.If your cooler switch board trips while turning ON.</strong></p><p><strong>7.In case your cooler turns ON but airflow does not start.</strong></p><p><strong>8.If your cooler switch works but motor doesnt run.</strong></p><p><strong>9.If your cooler turns OFF automatically while running.</strong></p><p><strong>10.Any ON/OFF related issue you feel, book the service.</strong></p>', 399, 1, 0, '2025-08-19 11:34:37', '2025-08-20 11:03:54', '223.236.127.103', NULL),
