(96, 17, 99, 1, 'Bad smell from air', 'Foul smell from coolers usually comes from stagnant water, dirty pads, or fungal growth. Our service ensures deep cleaning, fresh water circulation, and hygiene for clean, odor-free cooling.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your cooler air smells bad/unpleasant.</strong></p><p><strong>2.If your cooler throws smell like dirty water.</strong></p><p><strong>3.In case your cooler smells due to fungus/mold in pads.</strong></p><p><strong>4.If your cooler smells like burning plastic or wire.</strong></p><p><strong>5.If your cooler smell increases when water tank is filled.</strong></p><p><strong>6.When your cooler smells due to old/unwashed cooling pads.</strong></p><p><strong>7.If your cooler gives foul smell after long storage.</strong></p><p><strong>8.In case your cooler air smells due to dirty water tank.</strong></p><p><strong>9.If your cooler bad smell spreads in whole room.</strong></p><p><strong>10.Any type of smell issue you feel from cooler, book the service.</strong></p>', 499, 1, 0, '2025-08-19 11:38:08', '2025-08-20 11:00:06', '223.236.127.103', NULL),
(97, 17, 100, 1, 'Motor overheats', 'An overheating motor can lead to breakdowns and safety risks. Our service includes motor inspection, lubrication, and capacitor check to prevent damage and ensure safe, long-lasting performance.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your cooler motor becomes hot very quickly.</strong></p><p><strong>2.In case your cooler motor overheats and stops.</strong></p><p><strong>3.If your cooler motor emits burning smell.</strong></p><p><strong>4.If your cooler motor gets hot even at low speed.</strong></p><p><strong>5.When your cooler motor heat trips the power supply.</strong></p><p><strong>6.If your cooler motor heats and airflow reduces.</strong></p><p><strong>7.In case your cooler motor is damaged due to overheating.</strong></p><p><strong>8.If your cooler motor overheats after few hours of use.</strong></p><p><strong>9.If your cooler motor makes noise along with overheating.</strong></p><p><strong>10.Any overheating motor issue you feel, book the service.</strong></p>', 399, 1, 0, '2025-08-20 07:02:07', '2025-08-20 10:55:41', '223.236.127.103', NULL),
(98, 17, 101, 1, 'Button Problem', 'Faulty buttons or switches can make your cooler hard to operate. We repair or replace defective control panels, switches, and wiring to restore smooth and reliable functioning.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your cooler buttons are not working.</strong></p><p><strong>2.In case your cooler ON/OFF button does not respond.</strong></p><p><strong>3.If your cooler speed button is stuck or jammed.</strong></p><p><strong>4.If your cooler swing button is broken.</strong></p><p><strong>5.When your cooler buttons are loose and not changing speed.</strong></p><p><strong>6.If your cooler buttons need too much force to press.</strong></p><p><strong>7.If your cooler buttons make spark or burning smell.</strong></p><p><strong>8.In case your cooler buttons stop working suddenly.</strong></p><p><strong>9.If your cooler panel buttons dont work but remote works.</strong></p><p><strong>10.Any type of button/panel problem you feel, book the service.</strong></p>', 399, 1, 0, '2025-08-20 07:13:05', '2025-08-20 10:53:51', '223.236.127.103', NULL),
(99, 17, 102, 1, 'Air Cooler Other', 'We handle all other air cooler problems such as wiring faults, pad damage, uneven cooling, or power fluctuations. Our service ensures complete inspection and effective solutions for long-lasting performance.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If water bottle not fitting properly.</strong></p><p><strong>2.If air bubbles block water flow.</strong></p><p><strong>3.In case body cover is broken/damaged.</strong></p><p><strong>4.If tap lever is loose or broken.</strong></p><p><strong>5.If dispenser consumes more electricity than normal.</strong></p><p><strong>6.When dispenser stops automatically during use.</strong></p><p><strong>7.If dispenser gives electric shock when touched.</strong></p><p><strong>8.In case cooling/heating fan not working.</strong></p><p><strong>9.If dispenser plastic parts making noise.</strong></p><p><strong>10.Any other unusual issue you feel in dispenser, book the service.</strong></p>', 399, 1, 0, '2025-08-20 07:21:49', '2025-08-20 10:50:49', '223.236.127.103', NULL),
(100, 18, 103, 1, 'Fan Unusual noise', 'Unusual fan noise may be due to loose parts, motor issues, or lack of lubrication. Our service team inspects bearings, alignment, and motor health to ensure smooth, quiet, and efficient fan performance.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your fan is making unusual noise while running.</strong></p><p><strong>2.If your fan makes grinding or rattling sound.</strong></p><p><strong>3.In case your fan makes humming noise even at low speed.</strong></p><p><strong>4.If your fan blades are hitting or making knocking sound.</strong></p><p><strong>5.When your fan motor is noisy due to internal damage.</strong></p><p><strong>6.If your fan makes continuous vibration noise.</strong></p><p><strong>7.If your fan noise increases with speed.</strong></p><p><strong>8.In case your fan bearing is worn out causing sound.</strong></p><p><strong>9.If your fan squeaks or creaks while rotating.</strong></p><p><strong>10.Any kind of unusual noise you feel from fan, book the service.</strong></p>', 399, 1, 0, '2025-08-20 08:12:39', '2025-08-20 09:44:46', '223.236.127.103', NULL),
(101, 18, 104, 1, 'Fan on/off', 'A fan that doesnt turn on may face switch, capacitor, or wiring issues. Our service identifies the root cause and provides fast, safe repairs to restore normal functioning.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your fan is not turning on at all.</strong></p><p><strong>2.In case your fan switch is fine but fan not working.</strong></p><p><strong>3.If your fan does not start even after multiple tries.</strong></p><p><strong>4.If your fan needs manual push to start every time.</strong></p><p><strong>5.If your fan light indicator works but fan doesnt rotate.</strong></p><p><strong>6.In case your fan motor is completely dead.</strong></p><p><strong>7.If your fan stops working suddenly during use.</strong></p><p><strong>8.If your fan doesnt start even after regulator change.</strong></p><p><strong>9.If your fan makes humming sound but doesnt move.</strong></p><p><strong>10.Any condition where fan does not start/turn on, book the service.</strong></p>', 299, 1, 0, '2025-08-20 08:13:55', '2025-08-20 09:43:01', '223.236.127.103', NULL),
(102, 18, 105, 1, 'Fan too slow', 'Slow-moving fans indicate capacitor failure, dust build-up, or motor weakness. Our service cleans, repairs, and replaces faulty parts to restore powerful airflow and efficient cooling performance.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your fan speed is too slow compared to normal.</strong></p><p><strong>2.If your fan does not give proper airflow.</strong></p><p><strong>3.In case your fan runs slow even at full speed setting.</strong></p><p><strong>4.If your fan slows down after running for few minutes.</strong></p><p><strong>5.If your fan speed drops due to capacitor issue.</strong></p><p><strong>6.When your fan blades move slowly despite power supply.</strong></p><p><strong>7.If your fan is slower than other fans in same house.</strong></p><p><strong>8.If your fan becomes very slow in summer load.</strong></p><p><strong>9.In case your fan speed is unstable, sometimes fast, sometimes slow.</strong></p><p><strong>10.Any kind of slow speed problem you feel, book the service.</strong></p>', 399, 1, 0, '2025-08-20 08:14:35', '2025-08-20 09:40:20', '223.236.127.103', NULL),
(103, 18, 106, 1, 'Not starting Fan', 'Fans that dont start may have defective capacitors, switch issues, or motor problems. Our experts quickly diagnose the issue and carry out reliable repairs for smooth, hassle-free performance.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your fan is not turning on at all.</strong></p><p><strong>2.In case your fan switch is fine but fan not working.</strong></p><p><strong>3.If your fan does not start even after multiple tries.</strong></p><p><strong>4.If your fan needs manual push to start every time.</strong></p><p><strong>5.If your fan light indicator works but fan doesnt rotate.</strong></p><p><strong>6.In case your fan motor is completely dead.</strong></p><p><strong>7.If your fan stops working suddenly during use.</strong></p><p><strong>8.If your fan doesnt start even after regulator change.</strong></p><p><strong>9.If your fan makes humming sound but doesnt move.</strong></p><p><strong>10.Any condition where fan does not start/turn on, book the service.</strong></p>', 399, 1, 0, '2025-08-20 08:15:36', '2025-08-20 09:38:53', '223.236.127.103', NULL),
(104, 18, 107, 1, 'Capacitor issue', 'A faulty capacitor can cause your fan to slow down, not start, or stop working suddenly. Our experts test and replace defective capacitors to restore reliable speed and proper functioning of your fan.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your fan does not start and needs manual push.</strong></p><p><strong>2.If your fan runs at very low speed due to capacitor fault.</strong></p><p><strong>3.In case your fan stops suddenly after running for few minutes.</strong></p><p><strong>4.If your fan hums but blades dont rotate.</strong></p><p><strong>5.When your fan runs only at single speed.</strong></p><p><strong>6.If your fan vibrates or shakes due to weak capacitor.</strong></p><p><strong>7.If your fan starts very late after switching on.</strong></p><p><strong>8.In case your fan motor overheats due to capacitor issue.</strong></p><p><strong>9.If your fan fails frequently due to capacitor burnout.</strong></p><p><strong>10.Any type of capacitor related issue you feel, book the service.</strong></p>', 399, 1, 0, '2025-08-20 08:16:15', '2025-08-20 09:37:01', '223.236.127.103', NULL),
(105, 18, 108, 1, 'Regulator  not working', 'Fan regulator issues often result in speed not adjusting or fan running at fixed speed only. Our service checks wiring, regulator knob, and connections to ensure proper speed control and safe operation.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p>1.If your fan <strong>does not change speed with regulator</strong>.</p><p>2.If your fan <strong>runs at same speed on all levels</strong>.</p><p>3.In case your fan <strong>stops working when regulator is turned</strong>.</p><p>4.If your regulator <strong>heats up too quickly</strong>.</p><p>5.If your fan <strong>speed is too slow even at full regulator</strong>.</p><p>6.When regulator <strong>makes burning smell or sparks</strong>.</p><p>7.If your regulator <strong>knob is broken or loose</strong>.</p><p>8.In case your fan <strong>speed fluctuates continuously</strong>.</p><p>9.If your regulator <strong>wire connections are damaged</strong>.</p><p>10.Any type of regulator fault you feel, book the service.</p>', 299, 1, 0, '2025-08-20 08:17:01', '2025-08-20 09:35:03', '223.236.127.103', NULL),
(106, 18, 109, 1, 'Other Fan Issue', 'We handle all other fan issues such as overheating, vibrations, loose wiring, and wear & tear. Our experts ensure quick diagnosis and reliable solutions for all types of fan problems at home or office.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your fan blades are bent or damaged.</strong></p><p><strong>2.If your fan is shaking or wobbling while running.</strong></p><p><strong>3.In case your fan holder/rod is loose or broken.</strong></p><p><strong>4.If your fan paint/cover is damaged or burnt.</strong></p><p><strong>5.If your fan motor emits burning smell.</strong></p><p><strong>6.When your fan sparks inside motor or wiring.</strong></p><p><strong>7.If your fan switchboard connection is faulty.</strong></p><p><strong>8.In case your fan suddenly trips MCB or fuse.</strong></p><p><strong>9.If your fan needs frequent repairs again and again.</strong></p><p><strong>10.Any other unusual problem you feel in fan, book the service.</strong></p>', 299, 1, 0, '2025-08-20 08:17:54', '2025-08-20 09:33:34', '223.236.127.103', NULL),
(107, 19, 110, 1, 'Dim Light Issue', 'Dim lighting indicates weak connections, old tubes, or low voltage supply. Our experts inspect wiring, choke, and starter, resolving issues to restore bright and consistent illumination for your home, office, or workspace.', '<p><strong>Below cases you should book service:</strong></p><p>&nbsp;</p><p><strong>1.If your tube light/bulb glows very dim compared to normal.</strong></p><p><strong>2.In case your tube light/bulb does not brighten even after warm-up.</strong></p><p><strong>3.If your tube light/bulb is dim because of weak starter/holder issue.</strong></p><p><strong>4.If your tube light/bulb remains dim despite proper electricity supply.</strong></p><p><strong>5.If you feel your room is not getting enough light due to dim glow.</strong></p><p><strong>6.In case your tube light/bulb light reduces after few minutes of use.</strong></p><p><strong>7.If your tube light/bulb shows black spots or discoloration and becomes dim.</strong></p><p><strong>8.When dim light issue occurs due to old wiring or socket problem.</strong></p><p><strong>9.If the dim light issue is affecting your daily use and visibility.</strong></p><p><strong>10.Any kind of dim light problem you cannot identify, just book the service.</strong></p>', 399, 1, 0, '2025-08-20 08:54:24', '2025-08-20 09:30:30', '223.236.127.103', NULL);
INSERT INTO `Rate` (`rate_id`, `cate_id`, `subcate_id`, `city_id`, `title`, `description`, `how_it_work_description`, `amount`, `iStatus`, `isDelete`, `created_at`, `updated_at`, `strIP`, `time`) VALUES
(108, 19, 111, 1, 'flickers continuously', 'Continuous flickering can strain your eyes and damage electrical components. Our service checks for faulty starters, loose connections, or ballast problems, ensuring smooth, stable, and flicker-free lighting for comfortable daily use.', '<p><strong>Below cases you should book service:&nbsp;</strong></p><p>&nbsp;</p><p><strong>1.If your tube light/bulb keeps flickering continuously after switching on.</strong></p><p><strong>2.In case your tube light/bulb blinks several times before lighting up.</strong></p><p><strong>3.If your tube light/bulb flickers and does not give stable light.</strong></p><p><strong>4.If flickering happens due to loose connection or socket issue.</strong></p><p><strong>5.If your tube light/bulb makes buzzing sound while flickering.</strong></p><p><strong>6.When flickering causes strain to eyes or disturbance in work/study.</strong></p><p><strong>7.If your tube light/bulb flickers more in low voltage but doesnt stabilize.</strong></p><p><strong>8.If your tube light/bulb flickers and then turns off suddenly.</strong></p><p><strong>9.In case your tube light/bulb starter/choke or wiring causes flicker.</strong></p><p><strong>10.Any type of continuous flicker issue you feel like, book the service.</strong></p>', 299, 1, 0, '2025-08-20 08:55:27', '2025-08-20 09:28:54', '223.236.127.103', NULL),
(109, 19, 112, 1, 'overheating quickly', 'Overheating tube lights or bulbs can be risky and may damage wiring. Our service identifies faulty holders, wiring, or internal defects and provides safe repair or replacement to restore efficient, long-lasting, and secure lighting performance.', '<p><strong>Below Cases you should book service:&nbsp;</strong><br><br><strong>1.If your tube light/bulb becomes too hot within few minutes of switching on.</strong></p><p><strong>2.In case your tube light/bulb is overheating and giving burning smell.</strong></p><p><strong>3.If your tube light/bulb is overheating and turns off automatically.</strong></p><p><strong>4.If your tube light/bulb is getting too hot and holder/socket also heating up.</strong></p><p><strong>5.If you feel touching the bulb/tube after use is unsafe due to extreme heat.</strong></p><p><strong>6.In case of loose wiring or wrong fitting causing overheating.</strong></p><p><strong>7.If your tube light/bulb glass changes color or burns due to overheating.</strong></p><p><strong>8.If your tube light/bulb lifetime is reducing because of overheating.</strong></p><p><strong>9.When overheating causes fluctuation in brightness or light going off.</strong></p><p><strong>10.Any type of overheating problem you feel related to tube light/bulb, book the service.</strong></p>', 299, 1, 0, '2025-08-20 08:58:01', '2025-08-20 09:27:02', '223.236.127.103', NULL),
(110, 19, 113, 1, 'Other-Issue', 'Tube light or bulb service covers repair and replacement of faulty lights, flickering issues, loose connections, or complete failures. Our experts check wiring, holders, and switches to ensure safe and reliable lighting performance in your home or office.', '<p><strong>Below Cases you must should book a/c not cooling service:</strong></p><p>&nbsp;</p><p><strong>1.If your tube light is not turning on at all.</strong></p><p><strong>2. In any case if your tube light is overheating quickly.</strong></p><p><strong>3. If your tube light is giving very dim light.</strong></p><p><strong>4. If your tube light flickers continuously.</strong></p><p><strong>5. If you feel your tube light is making buzzing or humming noise.</strong></p><p><strong>6. If the tube light takes too long to glow after switching on.</strong></p><p><strong>7. In case your tube light switch on and off automatically after some time.</strong></p><p><strong>8. If your tube light starter or choke is damaged/not working.</strong></p><p><strong>9. If your tube light glass/tube is broken or blackened from inside.</strong></p><p><strong>10. Any type of problem you feel related to tube light working and you cannot understand, just book the service.</strong></p>', 299, 1, 0, '2025-08-20 09:08:03', '2025-08-20 09:24:49', '223.236.127.103', NULL),
